import fs from 'fs';
import https from 'https';
import Express from 'express';
import cookieParser from 'cookie-parser';
import bodyParser from 'body-parser';
import React from 'react';
import cookie from 'react-cookie';
import ReactDOM from 'react-dom/server';
import favicon from 'serve-favicon';
import compression from 'compression';
import path from 'path';
import PrettyError from 'pretty-error';
import { match } from 'react-router';
import { syncHistoryWithStore } from 'react-router-redux';
import { ReduxAsyncConnect, loadOnServer } from 'redux-connect';
import createHistory from 'react-router/lib/createMemoryHistory';
import { Provider } from 'react-redux';
import jwt from 'jsonwebtoken';
import xFrameOptions from 'x-frame-options';

import config from './config';
import createStore from './state/createStore';
import ApiClient from './helpers/ApiClient';
import Html from './helpers/Html';
import getRoutes from './routes';
import api from './api';
import oauth from './oauth';

const pretty = new PrettyError();
const app = new Express();
const server = https.createServer({
  key: fs.readFileSync('key.pem'),
  cert: fs.readFileSync('cert.pem')
}, app);

app.use(cookieParser());
app.use(bodyParser.urlencoded({
  extended: true
}));
app.use(bodyParser.json());
app.use(compression());
app.use(favicon(path.join(__dirname, '..', 'static', 'favicon.ico')));

app.use(Express.static(path.join(__dirname, '..', 'static')));

// Handle Authentication
app.use('/oauth', oauth);

// Use express router/middleware for API routes
app.use('/api', api);

// Prevent this app from being embedded in an iFrame
app.use(xFrameOptions());

// Check for expired auth cookie
app.use((req, res, next) => {
  if (req.cookies && req.cookies.exp) {
    // Convert exp to milliseconds for comparison with Date.now()
    const exp = req.cookies.exp * 1000;

    if (exp < Date.now()) {
      return res.redirect('/oauth/logout');
    }
  }
  next();
});

/**
 *  We have changed our Ping response_mode to `form_post` to allow
 *  strictly server side access of the token as well as prevent
 *  checksum errors on initial serverside render after login.
 */
app.use((req, res) => {
  let user = req.cookies.user;
  let exp = req.cookies.exp;

  // Handle login
  if (req.method === 'POST') {
    if (req.body.id_token && req.body.access_token) {
      // If we ever figure out the jwt verification key, we should do that here as well.
      // jwt.verify(req.body.id_token,config.pingKey);

      // Set user/auth cookie for the browser
      const userData = jwt.decode(req.body.id_token);

      user = {
        name: userData.given_name,
        username: userData.username
      };
      exp = jwt.decode(req.body.access_token).exp;

      // Set cookies
      res.cookie('user', user, { domain: config.host.replace(/^[^\.]+/, '') }); // eslint-disable-line
      res.cookie('exp', exp, { domain: config.host.replace(/^[^\.]+/, '') }); // eslint-disable-line
      res.cookie('accessToken', req.body.access_token, {
        httpOnly: true,
        secure: true,
        maxAge: ((exp * 1000) - (new Date().getTime())),
        domain: config.host.replace(/^[^\.]+/, '') // eslint-disable-line
      });
    }

    req.cookies.accessToken = req.body.access_token;
  }
  // server side rendering access to cookies
  cookie.plugToRequest(req, res);
  const data = {
    auth: {
      user,
      exp,
      accessToken: req.cookies.accessToken,
      userOrg: req.cookies.userOrg || 'BodyLab'
    }
  };

  if (__DEVELOPMENT__) {
    // Do not cache webpack stats: the script file would change since
    // hot module replacement is enabled in the development env
    webpackIsomorphicTools.refresh();
  }
  const client = new ApiClient(req);
  const memoryHistory = createHistory(req.originalUrl);
  const store = createStore(memoryHistory, client, data);
  const history = syncHistoryWithStore(memoryHistory, store);

  const hydrateOnClient = () => {
    res.send(`<!doctype html>\n${ReactDOM.renderToString(<Html assets={webpackIsomorphicTools.assets()} store={store} />)}`);
  };

  if (__DISABLE_SSR__) {
    hydrateOnClient();
    return;
  }

  match({ history, routes: getRoutes(store), location: req.originalUrl }, (error, redirectLocation, renderProps) => {
    if (redirectLocation) {
      res.redirect(redirectLocation.pathname + redirectLocation.search);
    } else if (error) {
      console.error('ROUTER ERROR:', pretty.render(error));
      res.status(500);
      hydrateOnClient();
    } else if (renderProps) {
      loadOnServer({ ...renderProps, store, helpers: { client } }).then(() => {
        const component = (
          <Provider store={store} key="provider">
            <ReduxAsyncConnect {...renderProps} />
          </Provider>
        );

        res.status(200);

        global.navigator = { userAgent: req.headers['user-agent'] };

        res.send(`<!doctype html>\n${ReactDOM.renderToString(<Html assets={webpackIsomorphicTools.assets()} component={component} store={store} />)}`);
      });
    } else {
      res.status(404).send('Not found');
    }
  });
});

if (config.port) {
  server.listen(config.port, (err) => {
    if (err) {
      console.error(err);
    }
    const apiPort = config.apiPort ? `:${config.apiPort}` : '';

    console.info('----\n==> ✅  %s is running, talking to API at %s.', config.app.title, `${config.apiProtocol}://${config.apiHost}${apiPort}`);
    console.info('==> 💻  Open https://%s:%s in a browser to view the app after webpack bundle is built.', config.host, config.port);
  });
} else {
  console.error('==>     ERROR: No PORT environment variable has been specified');
}

