require('babel-polyfill');

const environment = {
  development: {
    isProduction: false
  },
  production: {
    isProduction: true
  }
}[process.env.NODE_ENV || 'development'];

module.exports = Object.assign({
  host: process.env.HOST,
  port: process.env.PORT,
  protocol: process.env.PROTOCOL,
  apiProtocol: process.env.API_PROTOCOL,
  apiHost: process.env.API_HOST,
  apiPort: process.env.API_PORT,
  apiPath: process.env.API_PATH,
  apiToken: process.env.API_TOKEN,
  oauthHost: process.env.OAUTH_HOST,
  oauthRedirectUri: process.env.OAUTH_REDIRECTURI,
  oauthClientId: process.env.OAUTH_CLIENTID,
  oauthResponseType: process.env.OAUTH_RESPONSETYPE,
  oauthScope: process.env.OAUTH_SCOPE,
  oauthNonce: process.env.OAUTH_NONCE,
  gaAccountid: process.env.GA_ACCOUNT_ID,
  app: {
    title: 'NDA: Voltron',
    description: 'Defender of the bodyscan universe.',
    head: {
      titleTemplate: 'NDA: %s',
      meta: [
        { name: 'description', content: 'Defender of the bodyscan universe.' },
        { charset: 'utf-8' }
      ]
    }
  },

}, environment);

