/**
 * Analytics config for redux analyticsMiddleware
 */
export default {
  gaAccountid: process.env.GA_ACCOUNT_ID,
  rules: [
    {
      action: '^@@router/LOCATION_CHANGE$',
      method: 'pageview',
      args: (action) => action.payload.pathname
    },
    {
      action: '_REQUEST$',
      method: 'event',
      args: (action) => ({
        category: 'Request',
        action: action.type
      })
    },
    {
      action: '_ERROR$',
      method: 'event',
      args: (action) => ({
        category: 'Error',
        action: action.type,
        label: JSON.stringify(action.error)
      })
    },
    {
      action: '_SUCCESS(_POST)?$',
      method: 'event',
      args: (action) => ({
        category: 'Success',
        action: action.type
      })
    },
    {
      action: 'objViewer/SET',
      method: 'event',
      args: (action) => ({
        category: 'TriggerControl',
        action: action.type,
        label: action.data.triggeredControl
      })
    },
    {
      action: '^@@redux-form/(FOCUS|BLUR|CHANGE)$',
      method: 'event',
      args: (action) => {
        const formEvent = {
          category: `Form:${action.meta.form}`,
          action: action.type.replace('@@redux-form/', ''),
          label: action.meta.field
        };

        if (action.payload) {
          formEvent.label += `: ${JSON.stringify(action.payload)}`;
        }

        return formEvent;
      },
      disable: ['production']
    },
  ]
};

