export default (client) => (({ dispatch, getState }) => next => action => {
  if (typeof action === 'function') {
    return action(dispatch, getState);
  }

  const { promise, types, ...rest } = action; // eslint-disable-line no-redeclare

  if (!promise) {
    return next(action);
  }

  /**
   * Types are destructured from the the action. This allows use to name the actions
   * dynamically, but handle them identically across the board.
   */
  const [REQUEST, SUCCESS, FAILURE] = types;

  next({ ...rest, type: REQUEST });

  const actionPromise = promise(client, dispatch, getState);

  actionPromise.then(
    result => next({ ...rest, result, type: SUCCESS }),
    error => next({ ...rest, error, type: FAILURE })
  ).catch(error => {
    console.error('MIDDLEWARE ERROR:', error);
    next({ ...rest, error, type: FAILURE });
  });

  return actionPromise;
});

