import ReactGA from 'react-ga';

/**
 * React Google Analytics Redux Middleware.
 * This middleware will check incoming redux actions
 * and fire analytics depending on the rules array passed.
 * The rules array should be an array of rule objects that
 * have the following key:value definitions:
 *
 * action: String which represents a regular expression to match against action types.
 * method: String of ReactGA method name to invoke
 * (set|pageview|modalview|event|timing|outboundLink)
 * args: Arguments to pass to the ReactGA method being called.
 * This could be a string, object or a function that takes the current action as a
 * parameter and returns the expected string or object to be used as args.
 *
 * The following example invokes `ReactGA.pageview(path)` for a store setup
 * with react-router-redux on LOCATION_CHANGE actions passing the current pathname
 * as the path argument.
 *
 * rules = [{
 *   action: '^@@router/LOCATION_CHANGE$',
 *   method: 'pageview',
 *   args: (action) => action.payload.pathname,
 * }]
 *
 * @param  {String} Google Analytics ID
 * @param  {Array}  Array of rule objects to attach analytics to redux actions.
 * @return Result of the next middleware or dispatch in the middleware chain.
 */
export default ({ gaAccountid = '', rules = [] }) => {
  if (global.window) {
    // Intialize Google Analytics
    ReactGA.initialize(gaAccountid);
  }

  return (({ getState }) => next => action => {
    // Only applies to regular actions
    if (global.window && action.type) {
      rules.forEach(rule => {
        // does the current action match the rule regex?
        if (new RegExp(rule.action).test(action.type)) {
          // Is this rule disabled in our current environment?
          if (!rule.disable || !rule.disable.includes(global.window.__ENV__)) {
            // is method a ReactGA function?
            if (ReactGA[rule.method]) {
              // Get the args we need...
              const args = typeof rule.args === 'function' ? rule.args(action) : rule.args;

              // Set analytics user
              const { auth: { user } } = getState();

              if (user) {
                ReactGA.set({ userId: user.username });
              }

              // Fire Analytics
              ReactGA[rule.method](args);
            }
          }
        }
      });
    }

    return next(action);
  });
};

