import superagent from 'superagent';
import config from '../config';

const methods = ['get', 'post', 'put', 'patch', 'del'];

const formatUrl = (path) => {
  const adjustedPath = path[0] !== '/' ? `/${path}` : path;

  if (__SERVER__) {
    // Prepend host and port of the API server to the path and add the /data-api subpath.
    const apiPort = config.apiPort ? `:${config.apiPort}` : '';

    return `${config.apiProtocol}://${config.apiHost}${apiPort}${adjustedPath}`;
  }
  // Prepend `/api` to relative URL, to proxy to API server.
  return `/api${adjustedPath}`;
};

export default class ApiClient {
  constructor(req) {
    // This is hacky, but this is the only way I could find
    // to access the body for requests from the server
    if (__SERVER__) this.serverRequestBody = req.body;

    methods.forEach((method) => {
      this[method] = (path, { params, data } = {}) => new Promise((resolve, reject) => {
        const request = superagent[method](formatUrl(path));

        request.set('Accept', 'application/json');
        request.set('Content-Type', 'application/json');

        if (params) {
          request.query(params);
        }

        if (__SERVER__ && req.cookies.accessToken) {
          request.set('Authorization', `Bearer ${req.cookies.accessToken}`);
        }

        if (__SERVER__ && ['POST', 'PUT'].includes(request.method)) {
          request.send(this.serverRequestBody);
        } else if (data) {
          request.send(data);
        }

        request.end((err, { body } = {}) => {
          if (err) {
            // Are we on the client?
            if (!__SERVER__ && err.status === 401) {
              // Redirect to logout if unauthorized
              global.window.location.replace('/oauth/logout');
            }

            // Send platform error
            return reject(body || err);
          }

          // Success!
          return resolve(body);
        });
      });
    });
  }
  /*
   * There's a V8 bug where, when using Babel, exporting classes with only
   * constructors sometimes fails. Until it's patched, this is a solution to
   * "ApiClient is not defined" from issue #14.
   * https://github.com/erikras/react-redux-universal-hot-example/issues/14
   *
   * Relevant Babel bug (but they claim it's V8): https://phabricator.babeljs.io/T2455
   *
   * Remove it at your own risk.
   */
  empty() {}
}

