import React, { PropTypes } from 'react';
import glamorous from 'glamorous';
import { PrimaryButton } from '@nike/ruxac';
import { defaultStyle } from './ButtonField.style';

const _ButtonField = ({ className, input: { onChange, value }, label }) => (
  <div className={className}>
    <PrimaryButton
      className={`buttonField ${value === true ?
        'buttonChecked' :
        'buttonUnchecked'
      }`}
      onClick={() => { onChange(!value); }}>
      <div className="buttonField__row row marg--none">
        <div className="buttonField__title col-xs-10">{label}</div>
        <div className="buttonField__icon col-xs-2">
          <i
            className={`${value === true ?
            'fa fa-check-circle' :
            'fa fa-circle-thin'
          }`} />
        </div>
      </div>
    </PrimaryButton>
  </div>
);

_ButtonField.propTypes = {
  className: PropTypes.string.isRequired,
  input: PropTypes.object.isRequired,
  label: PropTypes.string
};

_ButtonField.defaultProps = {
  label: 'Label'
};

const ButtonField = glamorous(_ButtonField)(defaultStyle);

export default ButtonField;

