import React, { PropTypes } from 'react';
import styles from './CaptureDetail.scss';
import renderDetailViewAttributes from './detailHelpers';

const CaptureDetail = ({ capture, captureInstrument }) => (
  <div
    className={`row ${styles.captureDetail}`}
    data-e2e={`capture-detail-wrapper-${capture.id} instrument-key-${captureInstrument.instrument_key}`}
  >
    <div className={`col-xs-12 ${styles.captureBox}`} data-e2e="capture-detail-box">
      <div className="row" data-e2e="capture-detail-headers">
        <div className="col-xs-6">Key</div>
        <div className="col-xs-6">Value</div>
      </div>
      {renderDetailViewAttributes(capture, captureInstrument)}
    </div>
  </div>
);

CaptureDetail.propTypes = {
  captureInstrument: PropTypes.object.isRequired,
  capture: PropTypes.object.isRequired,
};

export default CaptureDetail;

