import React from 'react';
import resolvePath from 'object-resolve-path';
import shortid from 'shortid';
import KeyValueRow from './KeyValueRow';
import styles from './CaptureDetail.scss';

export const getInstrumentView = (viewTypes = {}, JSONSchema) =>
  resolvePath(viewTypes, 'detail_view') ||
  resolvePath(viewTypes, 'default') ||
  Object.keys(JSONSchema.properties);

export const getPropertyType = (customFieldDefinition = {}, JSONSchema) =>
  (resolvePath(customFieldDefinition, 'type') ? customFieldDefinition.type : JSONSchema.type);

export const renderKeyValueRow = (
  attributeValue,
  index,
  propertyToDisplay,
  JSONSchema,
  customFieldDefinition,
  didIComeFromAnArray = false) => {
  const propertyType = getPropertyType(customFieldDefinition, JSONSchema);

  switch (propertyType) {
    case 'string':
    case 'number':
      return (<KeyValueRow
        key={shortid.generate()}
        title={propertyToDisplay}
        value={JSON.stringify(attributeValue)}
        index={index} />);
    case 'object':
    case 'objectgroup':
      const theObject = attributeValue;

      return manageObject( // eslint-disable-line
        theObject,
        propertyToDisplay,
        JSONSchema,
        customFieldDefinition,
        didIComeFromAnArray
      );
    case 'array':
    case 'arraygroup':
      const theArray = attributeValue;

      return attributeValue && manageArray(theArray, propertyToDisplay, JSONSchema, customFieldDefinition); // eslint-disable-line
    default:
      return (<KeyValueRow
        key={shortid.generate()}
        title={propertyToDisplay}
        value={attributeValue}index={index} />);
  }
};

export const manageArray = (
  theArray,
  propertyToDisplay,
  JSONSchema,
  customFieldDefinition
) =>
  <div
    key={shortid.generate()}
    className={styles.arrayDiv}
    data-e2e="capture-detail-array-attribute-wrapper">
    <hr />
    <p data-e2e="capture-detail-array-attribute-title">{propertyToDisplay}</p>
    {theArray.map((item, i) =>
