import React, { Component, PropTypes } from 'react';
import { connect } from 'react-redux';
import { reduxForm, Field } from 'redux-form';
import { browserHistory } from 'react-router';
import resolvePath from 'object-resolve-path';
import glamorous from 'glamorous';
import * as checkinActions from 'state/modules/checkin';
import * as checkinSelectors from 'state/selectors/checkinSelectors';
import * as instrumentSelectors from 'state/selectors/instrumentSelectors';
import { AsyncButton } from '@nike/ruxac';
import { FieldAutoCompleteInput, FieldDatePicker } from '@nike/outfielder';
import { ButtonField } from 'components';
import { defaultStyle } from './CheckinForm.style';

// create new date if no init vals; setHours separately
// or else this declares as a str instead of a date obj
const today = new Date();

today.setHours(0, 0, 0, 0);

const mapStateToProps = (state) => ({
  enableCheckinButton: checkinSelectors.enableCheckinButton(state),
  releaseWaiverConsentInstrument: instrumentSelectors.getLatestInstrument('release_and_waiver_consent')(state),
  isCheckingIn: checkinSelectors.isCheckingIn(state),
  user: state.auth.user,
  userOrg: state.auth.userOrg,
  subjectId: checkinSelectors.getCheckInSubjectId(state),
  visitDate: resolvePath(state, 'form.checkinForm.values.visit_date') || today,
  visitInstrument: instrumentSelectors.getLatestInstrument('visit')(state),
  formValues: checkinSelectors.getCheckInFormValues(state)
});
const mapDispatchToProps = {
  checkinSubject: checkinActions.checkinSubject
};

class _CheckinForm extends Component {
  static propTypes = {
    checkinSubject: PropTypes.func.isRequired,
    className: PropTypes.string.isRequired,
    enableCheckinButton: PropTypes.bool,
    formValues: PropTypes.object,
    isCheckingIn: PropTypes.bool,
    releaseWaiverConsentInstrument: PropTypes.object.isRequired,
    subjectId: PropTypes.number.isRequired,
    user: PropTypes.object.isRequired,
    userOrg: PropTypes.string.isRequired,
    visitInstrument: PropTypes.object.isRequired
  }

  handleCheckIn = () => {
    const {
      checkinSubject,
      formValues: {
        location,
        releaseWaiverConsentBox: createReleaseWaiver,
        visit_date,
      },
      releaseWaiverConsentInstrument,
      subjectId,
      user,
      userOrg,
      visitInstrument,
    } = this.props;

    const visitData = {
      instrument_id: visitInstrument.id,
      instrument_key: visitInstrument.instrument_key,
      instrument_version: visitInstrument.version,
      capture_by_user: user.username,
      capture_country: 'USA',
      capture_by_org: userOrg,
      subject_id: subjectId,
      attributes: {
        visit_date,
        location,
      }
    };
    let consentData;

    if (createReleaseWaiver) {
      consentData = {
        instrument_id: releaseWaiverConsentInstrument.id,
        instrument_key: releaseWaiverConsentInstrument.instrument_key,
        instrument_version: releaseWaiverConsentInstrument.version,
        capture_by_user: user.username,
        capture_country: 'USA',
        capture_by_org: userOrg,
        subject_id: subjectId,
        attributes: {
          release_and_waiver_consent_date: visit_date
        }
      };
    }

    checkinSubject(visitData, consentData).then(() => {
      browserHistory.push('/subject');
    });
  }

  render() {
    const {
      className,
      enableCheckinButton,
      isCheckingIn,
      releaseWaiverConsentInstrument,
      visitInstrument: { attributes: { custom_field_types: { location, visit_date } } }
    } = this.props;

    return (
      <div className={className}>
        <div
          data-e2e="confirm-visit-info-wrapper"
          className="confirmVisit__info row pad marg--bottom-h">
          <div
            data-e2e="confirm-visit-info-card"
            className="confirmVisit__card col-xs-12 pad">
            <div
              data-e2e="confirm-visit-info-date-wrapper"
              className="confirmVisit__date col-xs-2">
              <h1
                data-e2e="confirm-visit-info-date-day"
                className="confirmVisit__day marg--none">
              </h1>
              <h1 className="confirmVisit__month marg--none">
              </h1>
            </div>
            <div
              data-e2e="confirm-visit-study-info-wrapper"
              className="confirmVisit__study col-xs-10">
              <h2
                data-e2e="confirm-visit-study-info-visit-id"
                className="confirmVisit__visitId marg--none">
              </h2>
              <p
                data-e2e="confirm-visit-study-info-study-title"
                className="confirmVisit__studyTitle marg--none">
              </p>
            </div>
          </div>
          <div
            data-e2e="confirm-visit-info-card-buttons"
            className="confirmVisit__card col-xs-12">
            <div
              data-e2e="confirm-visit-date-input-wrapper"
              className="confirmVisit__card__inner col-xs-12 pad">
              <div className="col-xs-12">
                <Field
                  data-e2e="confirm-visit-date-input-field"
                  name="visit_date"
                  label={visit_date.title}
                  component={FieldDatePicker}
                />
              </div>
              <div data-e2e="confirm-visit-location-input-wrapper" className="col-xs-12">
                <Field
                  data-e2e="confirm-visit-location-input-field"
                  component={FieldAutoCompleteInput}
                  label={location.title}
                  name="location"
                  options={location.suggestions}
                  openOnFocus
                />
              </div>
              <h1 className="confirmVisit__card__title" data-e2e="confirm-visit-title-waiver">Waivers</h1>
              <div className="row">
                <div data-e2e="confirm-visit-release-waiver" className="col-xs-6">
                  <Field
                    name="releaseWaiverConsentBox"
                    label={releaseWaiverConsentInstrument.name}
                    component={ButtonField} />
                </div>
              </div>
            </div>
          </div>
        </div>
        <AsyncButton
          data-e2e="confirm-visit-create-button"
          disabled={!enableCheckinButton}
          loading={isCheckingIn}
          onClick={this.handleCheckIn}>
          Check-in
        </AsyncButton>
      </div>
    );
  }
}

const CheckinForm = connect(mapStateToProps, mapDispatchToProps)(
  reduxForm({
    form: 'checkinForm',
    initialValues: {
      visit_date: today
    }
  })(glamorous(_CheckinForm)(defaultStyle))
);

export default CheckinForm;

