import { viewDuckFactory } from '@nike/mother-goose';
import { createVisit } from './visits';
import { createReleaseAndWaiverConsent } from './releaseAndWaiverConsent';

const CHECKIN_REQUEST = 'checkin/CHECKIN_REQUEST';
const CHECKIN_SUCCESS = 'checkin/CHECKIN_SUCCESS';
const CHECKIN_ERROR = 'checkin/CHECKIN_ERROR';

const initialState = {
  subjectId: null,
  createdVisitId: null,
  checkingIn: false,
  checkinError: false,
  errorMessage: null
};

const checkin = viewDuckFactory('checkin', initialState);

const reducer = (state = initialState, action = {}) => {
  switch (action.type) {
    case CHECKIN_REQUEST:
      return {
        ...state,
        checkingIn: true
      };
    case CHECKIN_SUCCESS:
      return {
        ...state,
        checkingIn: false,
        checkinError: false
      };
    case CHECKIN_ERROR:
