import { createSelector } from 'reselect';
import resolvePath from 'object-resolve-path';

export const isCheckingIn = (state) => resolvePath(state, 'views.checkin.checkingIn');
export const isReleaseWaiverChecked = (state) => !!resolvePath(state, 'form.checkinForm.values.releaseWaiverConsentBox');
export const getCheckInSubjectId = (state) => resolvePath(state, 'views.checkin.subjectId');
export const getSubjects = (state) => resolvePath(state, 'subjects.data.items');
export const getCheckInFormValues = (state) => resolvePath(state, 'form.checkinForm.values');

export const isReleaseWaiverAbsentOrExpired = () => true;

export const enableCheckinButton = createSelector(
  isReleaseWaiverChecked,
  isReleaseWaiverAbsentOrExpired,
  (releaseWaiverConsent, needsReleaseWaiver) => {
    if (needsReleaseWaiver) {
      return releaseWaiverConsent;
    }
    return true;
  }
);

export const getCheckInSubject = createSelector(
  getCheckInSubjectId,
  getSubjects,
  (id, subjects) => {
    if (id) {
      return subjects[id];
    }
  }
);

