import React, { Component, PropTypes } from 'react';
import { connect } from 'react-redux';
import { SecondaryButton } from '@nike/ruxac';
import { setTriggeredControl } from 'state/modules/objViewer';
import { SET_CONTROLS, CONTROL_TYPE_PAN, CONTROL_TYPE_TUMBLE } from 'helpers/Three/SceneController';

class _ModeControls extends Component {
  static propTypes = {
    dispatch: PropTypes.func.isRequired,
    SceneController: PropTypes.object.isRequired
  }

  constructor(props) {
    super(props);

    this.state = {
      panEnabled: false
    };
  }

  enablePan = () => {
    const { dispatch, SceneController } = this.props;

    // dispatching directly as this is purely for analytics
    dispatch(setTriggeredControl(CONTROL_TYPE_PAN));
    SceneController.update(SET_CONTROLS, CONTROL_TYPE_PAN);
    this.setState({ panEnabled: true });
  }

  enableTumble = () => {
    const { dispatch, SceneController } = this.props;

    // dispatching directly as this is purely for analytics
    dispatch(setTriggeredControl(CONTROL_TYPE_TUMBLE));
    SceneController.update(SET_CONTROLS, CONTROL_TYPE_TUMBLE);
    this.setState({ panEnabled: false });
  }

  render() {
    const { panEnabled } = this.state;

    return (
      <div className="controlGroup">
        <SecondaryButton
          className="controlButton"
          onClick={this.enableTumble}
          style={{ zIndex: 'auto' }}
          tooltip="Tumble">
          <svg
            className={panEnabled === false ? 'selected' : ''}>
            <use xlinkHref="#tumble" />
          </svg>
        </SecondaryButton>
        <SecondaryButton
          className="controlButton"
          onClick={this.enablePan}
          style={{ zIndex: 'auto' }}
          tooltip="Pan">
          <svg
            className={panEnabled === true ? 'selected' : ''}>
            <use xlinkHref="#pan" />
          </svg>
        </SecondaryButton>
      </div>
    );
  }
}

const ModeControls = connect()(_ModeControls);

export default ModeControls;

