/* eslint-disable */

import TWEEN from 'tween.js';
import * as THREE from 'three';
import { loadObjFromUrl } from './ThreeLoaders';
import Scene, { HEIGHT } from './Scene';

const SNAPSHOT_NAME = 'Atlas_Snapshot.png';
const ROT_ANGLE = Math.PI / 4;
const MOUSE_BUTTON_LEFT = 0;
const ZOOM_AMOUNT = 0.1;
const TWEEN_TRANSITION_TIME = 300;

export const ZOOM_IN = 'ZOOM_IN';
export const ZOOM_OUT = 'ZOOM_OUT';
export const TAKE_SNAPSHOT = 'TAKE_SNAPSHOT';
export const SET_CONTROLS = 'SET_CONTROLS';
export const CHANGE_VIEW_SIZE = 'CHANGE_VIEW_SIZE';
export const ON_WINDOW_BLUR = 'ON_WINDOW_BLUR';
export const ON_MOUSE_UP = 'ON_MOUSE_UP';
export const ON_MOUSE_DOWN = 'ON_MOUSE_DOWN';
export const ON_MOUSE_MOVE = 'ON_MOUSE_MOVE';
export const ON_KEY_PRESS_UP = 'ON_KEY_PRESS_UP';
export const ON_KEY_PRESS_DOWN = 'ON_KEY_PRESS_DOWN';
export const DESTROY = 'DESTROY';
export const CONTROL_TYPE_TUMBLE = 'CONTROL_TYPE_TUMBLE';
export const CONTROL_TYPE_PAN = 'CONTROL_TYPE_PAN';
export const CHANGE_TEXTURE = 'CHANGE_TEXTURE';

export default class SceneController {
  initialModel = () => ({
    // Scene
    isInitialized: false,
    cameraPreset: 0,
    scene: undefined,
    // Generate
    humanMesh: undefined,
    currentModel: undefined,
    // Controls
    isPanEnabled: false,
    // Global
    mouse: new THREE.Vector2(),
    previousMousePosition: { x: 0, y: 0 },
    isMouseDown: false,
    isDragging: false,
    isCmdKeyPressed: false
  });


  updateModel = (obj) => {
    this.MapModel = Object.assign({}, this.MapModel, obj);
  }

  // Camera
  // NOTE: this initializes camera view from front position. cameraPreset is always Zero
  cameraChange = (model) => {
    const {humanMesh, cameraPreset, scene: {objectGroup, camera}} = model;

    if (objectGroup != null) {
      this.updateModel({cameraPreset: 0});
      const setposition = 0 * ROT_ANGLE;
      humanMesh.rotation.x = 0;
      humanMesh.rotation.y = 0;
      humanMesh.position.set(0.0, 0.0, 0.0);

      objectGroup.rotation.y = setposition;
      objectGroup.rotation.x = 0;
      objectGroup.position.set(0.0, 0.0, 0.0);

      camera.position.set(0.0, 1.0, 3.1);
      camera.lookAt(new THREE.Vector3(0, 0.9, 0));
      camera.up = new THREE.Vector3(0, 1, 0);
    }
  };

  // CONTROLS /////////////////////////////////////////
  // Take Sanpshot of current model
  renderImageData = (model) => {
    // NOTE: generate frame to snapshot
    const {camera, renderer, scene} = model;
    renderer.render(scene, camera);
    return renderer.domElement.toDataURL();
  };

  getMovePosition = (cameraPreset, preset) => {
    const delta = cameraPreset - preset;
    let transitionPreset = preset;
    if (delta > 4) {
      transitionPreset += 8;
    } else if (delta < -4) {
      transitionPreset -= 8;
    }
    return transitionPreset;
  }

  moveTo = (position, model, updateHandler) => {
    const {cameraPreset, mouse, scene: {camera, objectGroup}} = model;
    const transitionPreset = this.getMovePosition(cameraPreset, position);
    let yPos = transitionPreset * ROT_ANGLE;

    new TWEEN.Tween(objectGroup.rotation)
      .to({ x: 0, y: yPos }, TWEEN_TRANSITION_TIME)
      .easing(TWEEN.Easing.Cubic.Out)
      .onComplete(() => {
        objectGroup.rotation.y = position * ROT_ANGLE;
      })
      .onUpdate(() => {
        updateHandler(mouse, camera);
      })
      .start();

      // TODO: do before call
      this.updateModel({cameraPreset: position})
  };

  zoomIn = (zoomAmt = ZOOM_AMOUNT, camera = this.scene.camera) => {
    camera.position.z -= zoomAmt;
  };

  zoomOut = (zoomAmt = ZOOM_AMOUNT, camera = this.scene.camera) => {
    camera.position.z += zoomAmt;
  };

  setControls = controlType => {
    return controlType === CONTROL_TYPE_PAN;
  };
  // CONTROLS /////////////////////////////////////////


  // EVENT LISTENERS /////////////////////////////////////////
  _onMouseUp = event => this.update(ON_MOUSE_UP, event);
  _onMouseDown = event => this.update(ON_MOUSE_DOWN, event);
  _onMouseMove = event => this.update(ON_MOUSE_MOVE, event);
  _onKeyPressDown = event => this.update(ON_KEY_PRESS_DOWN, event);
  _onKeyPressUp = event => this.update(ON_KEY_PRESS_UP, event);
  _onResize = event => this.update(CHANGE_VIEW_SIZE, event);
  _onBlur = event => this.update(ON_WINDOW_BLUR, event);

  addEventListeners = () => {
    document.addEventListener('mousemove', this._onMouseMove, false);
    document.addEventListener('mouseup', this._onMouseUp, false);
    document.addEventListener('mousedown', this._onMouseDown, false);
    document.addEventListener('keyup', this._onKeyPressUp, false);
    document.addEventListener('keydown', this._onKeyPressDown, false);
    window.addEventListener('resize', this._onResize, false);
    window.addEventListener('blur', this._onBlur, false);
  };

  removeEventListeners = () => {
    document.removeEventListener('mousemove', this._onMouseMove, false);
    document.removeEventListener('mouseup', this._onMouseUp, false);
    document.removeEventListener('mousedown', this._onMouseDown, false);
    document.removeEventListener('keydown', this._onKeyPressDown, false);
    document.removeEventListener('keyup', this._onKeyPressUp, false);
    window.removeEventListener('resize', this._onResize, false);
    window.removeEventListener('blur', this._onBlur, false);
  };
  // EVENT LISTENERS /////////////////////////////////////////

  // AUTO ROTATE EVENT LISTENERS /////////////////////////////
  addAutoRotateEventListeners = () => {
    document.addEventListener('mouseup', this._onMouseUp, false);
    document.addEventListener('mousedown', this._onMouseDown, false);
    window.addEventListener('resize', this._onResize, false);
  }

  removeAutoRotateEventListeners = () => {
    document.removeEventListener('mouseup', this._onMouseUp, false);
    document.removeEventListener('mousedown', this._onMouseDown, false);
    document.removeEventListener('mousemove', this._onMouseMove, false);
    window.removeEventListener('resize', this._onResize, false);
  }

  /// MOUSE STUFFS ///////////////////////////////////////////
  onMouseDown = (event, model) => {
