/* eslint-disable */

import * as THREE from 'three';
import OBJLoader from './vendor/OBJLoader';

const updateProgress = (progress, progressCallback) => {
  // get a ratio; turn it into a pct; round up to a whole num
  const complete = Math.round(progress.loaded / progress.total * 100);
  // callback to our ViewPane updateProgress fn
  progressCallback(complete);
}

export async function loadObjFromUrl(objUrl, progressCallback) {
  const objLoader = new OBJLoader();

  return new Promise(resolve => {
    objLoader.load(objUrl, resolve, xhr => updateProgress(xhr, progressCallback), xhr => console.log('error loading obj'));
  });
}

