/* eslint-disable */
import TWEEN from 'tween.js';
import * as THREE from 'three';

export const HEIGHT = 800;

export default class Scene {
  // Scene
  createDirectionalLights = scene => {
    const mainLight = new THREE.DirectionalLight(0xffffff);

    mainLight.position.set(0, 2.5, 2.5).normalize();
    mainLight.castShadow = true;

    const target = new THREE.Object3D();
    target.position.set(0, 1.5, 0).normalize();

    mainLight.target = target;

    return scene.add(mainLight);
  };

  createRenderer = (container) => {
    const renderer = new THREE.WebGLRenderer({ antialias: true });

    renderer.setPixelRatio(container.devicePixelRatio);
    renderer.setSize(container.offsetWidth, HEIGHT);
    renderer.setClearColor(0xf8f9f9);
    renderer.shadowMap.type = THREE.PCFSoftShadowMap;

    return renderer;
  };

  toggleAutoRotate = () => {
    this.autoRotate = !this.autoRotate;
  };

  enableAutoRotate = () => {
    this.autoRotate = true;
  };

  disableAutoRotate = () => {
    this.autoRotate = false;
  };

  render = (renderer, scene, camera) => {
    if (renderer) {
      TWEEN.update();
      if (this.autoRotate && this.objectGroup) {
        this.objectGroup.rotation.y += 0.01;
      }
      renderer.render(scene, camera);
    }
    requestAnimationFrame(() => this.render(renderer, scene, camera));
  };

  constructor(containerSelector, autoRotate = false) {
    this.container = document.querySelector(containerSelector);
    this.scene = new THREE.Scene();
    this.camera = new THREE.PerspectiveCamera(45, this.container.offsetWidth / HEIGHT, 0.01, 2000);
    this.renderer = this.createRenderer(this.container);

    this.autoRotate = autoRotate;

    this.container.appendChild(this.renderer.domElement);

    this.lights = this.createDirectionalLights(this.scene);

    this.objectGroup = new THREE.Group();

    this.scene.add(this.objectGroup);

    this.render(this.renderer, this.scene, this.camera);
  };
}

