import React, { Component, PropTypes } from 'react';
import { browserHistory } from 'react-router';
import { connect } from 'react-redux';
import { Button } from '@nike/lipstick';
import resolvePath from 'object-resolve-path';
import { CaptureDetail } from 'components';
import * as resourceLoaderActions from 'state/modules/resourceLoader';
import * as editCaptureActions from 'state/modules/editCapture';
import { getResourceById } from 'state/selectors/resourceLoaderSelectors';
import styles from './PedaData.scss';

const mapStateToProps = (state, { data, resourceId }) => ({
  pedaInstrument: resolvePath(state, `instruments.data.items["${data.instrument_key}"]["${data.instrument_version}"]`) || {},
  resource: getResourceById(resourceId)(state)
});

const mapDispatchToProps = {
  loadResource: resourceLoaderActions.loadResource,
  setCaptureToEdit: editCaptureActions.setCaptureToEdit
};

class _PedaData extends Component {
  static propTypes = {
    data: PropTypes.object,
    loadResource: PropTypes.func.isRequired,
    pedaInstrument: PropTypes.object,
    resource: PropTypes.object,
    resourceId: PropTypes.number,
    setCaptureToEdit: PropTypes.func.isRequired,
  }

  componentDidMount() {
    const { loadResource, resource, resourceId } = this.props;

    if (!resource) {
      loadResource(resourceId);
    } else if (!resource.loading && !resource.download_url) {
      loadResource(resourceId);
    }
  }

  editPeda = () => {
    const { data, setCaptureToEdit } = this.props;

    setCaptureToEdit(data.id);
    browserHistory.push('/subject/capture/edit');
  }

  render() {
    const { data, pedaInstrument, resource } = this.props;

    return (
      <div className={`peda-data ${styles.pedaWrapper}`}>
        <div className={styles.pedaInner}>
          <div className={styles.editPeda}>
            <div className={styles.editPedaBtn}>
              <Button
                buttonType="icon"
                iconClassName="fa fa-pencil fa-2x"
                tooltip="Edit"
                tooltipPosition="top-left"
                onClick={this.editPeda}
              />
            </div>
          </div>
          <CaptureDetail
            capture={data}
            captureInstrument={pedaInstrument}
          />
        </div>
        {resource && !resource.loading &&
          <a target="_blank" download rel="noopener noreferrer" href={resource.download_url}>
            <Button
              backgroundColor={'#fa5400'}>
                Download
            </Button>
          </a>
        }
      </div>
    );
  }
}

const PedaData = connect(mapStateToProps, mapDispatchToProps)(_PedaData);

export default PedaData;

