/**
 * Resource loader
 * Fetch only for resources. Sets loading and error
 * states individually on resources.
 */
const FETCH_REQUEST = 'resourceLoader/FETCH_REQUEST';
const FETCH_SUCCESS = 'resourceLoader/FETCH_SUCCESS';
const FETCH_ERROR = 'resourceLoader/FETCH_ERROR';

/**
 * Resources will be an object of resource id keys and
 * their resource object values with additional properties
 * defined in resourceInitialState
 */
const initialState = {};

export const initializeResource = (id, resource = {}) => ({
  ...resource,
  id,
  loading: true,
  loadError: false,
  error: ''
});

const reducer = (state = initialState, action = {}) => {
  switch (action.type) {
    case FETCH_REQUEST:
      return {
        ...state,
        [action.id]: initializeResource(action.id, state[action.id])
      };
    case FETCH_SUCCESS:
      return {
        ...state,
        [action.id]: {
          ...state[action.id],
          ...action.result,
          loading: false,
        }
      };
    case FETCH_ERROR:
      return {
        ...state,
        [action.id]: {
          ...state[action.id],
          loading: false,
          loadError: true,
          error: action.error
        }
      };
    default:
      return state;
  }
};

export const loadResource = (id) => ({
  types: [FETCH_REQUEST, FETCH_SUCCESS, FETCH_ERROR],
  promise: (client) => client.get(`/resources/${id}`),
  id
});

export default reducer;

