import React, { Component, PropTypes } from 'react';
import { connect } from 'react-redux';
import resolvePath from 'object-resolve-path';
import { Banner } from '@nike/lipstick';
import { browserHistory } from 'react-router';
import DynamicForm, { createValidator, getInstrumentInitialValues } from '@nike/outfielder';
import { instrumentSelectors, captureSelectors, profileSelectors } from 'state/selectors';
import * as captureActions from 'state/modules/captures';
import { isElectron } from 'helpers/electron';
import { getLastLocation } from 'state/selectors/locationSelectors';
import styles from './PedaCreateForm.scss';

export const mapStateToProps = (state) => ({
  captureCreating: captureSelectors.getCaptureIsCreating(state),
  lastLocation: getLastLocation(state),
  pedaInstrument: instrumentSelectors.getLatestInstrument('peda')(state),
  previousVisitWithPeda: profileSelectors.getMostRecentVisitWithPedaData(state) || { peda: { attributes: {} } },
  subject: captureSelectors.getCreateCaptureSubject(state),
  user: state.auth.user,
  userOrg: state.auth.userOrg,
  visitId: captureSelectors.getCreateCaptureVisitId(state)
});

export const mapDispatchToProps = {
  createCapture: captureActions.createCapture
};

class _PedaCreateForm extends Component {
  static propTypes = {
    createCapture: PropTypes.func.isRequired,
    captureCreating: PropTypes.bool.isRequired,
    lastLocation: PropTypes.string.isRequired,
    pedaInstrument: PropTypes.object,
    previousVisitWithPeda: PropTypes.object,
    subject: PropTypes.object.isRequired,
    user: PropTypes.object,
    userOrg: PropTypes.string,
    visitId: PropTypes.number.isRequired
  }

  getOrphanedKeys = () => {
    const {
      previousVisitWithPeda: { peda: capture },
      pedaInstrument
    } = this.props;

    return Object.keys(capture.attributes).reduce((acc, key) => {
      if (!pedaInstrument.capture_attribute_definitions.properties[key]) {
        acc.push(key);
      }
      return acc;
    }, []);
  }

  goBack = () => {
    const { lastLocation } = this.props;

    browserHistory.push(lastLocation);
  }

  prepareInitialValues = () => {
    const {
      pedaInstrument,
      previousVisitWithPeda: { peda: { attributes } },
      subject
    } = this.props;
    const orphanedKeys = this.getOrphanedKeys();

    const initFromPrevious = Object.keys(attributes).reduce((acc, key) => {
      if (!orphanedKeys.includes(key)) {
        acc[key] = attributes[key];
      }
      return acc;
    }, {});

    const initFromInstrument = getInstrumentInitialValues(
                    JSON.parse(JSON.stringify(pedaInstrument.capture_attribute_definitions)),
                    resolvePath(pedaInstrument, 'attributes.custom_field_types') || {},
                    resolvePath(pedaInstrument, 'attributes.view_types') || {},
                    'createform',
                    { gender: subject.attributes.sex, ...subject.attributes }
                  );

    // if we prepared any initial values from a previous capture, return it
    // (after we've merged any new defaults from instrument)
    if (Object.keys(initFromPrevious).length) {
      return { ...initFromInstrument, ...initFromPrevious };
    }

    // otherwise prepare initial values based on instrument def
    return initFromInstrument;
  }

  submitCapture = (values) => {
    const {
      createCapture,
      pedaInstrument,
      subject,
      user,
      userOrg,
      visitId
    } = this.props;

    const data = {
      instrument_key: pedaInstrument.instrument_key,
      instrument_version: pedaInstrument.version,
      capture_by_user: user.username,
      capture_country: 'USA',
      capture_by_org: userOrg,
      subject_id: subject.id,
      visit_id: visitId,
      attributes: { ...values }
    };

    createCapture(data).then(() => {
      if (isElectron()) {
        window.Bridge.initializeScan(visitId, subject.attributes.first_name, subject.attributes.last_name);
      }
      browserHistory.push('/subject');
    });
  }

  renderOrphans = () => {
    const { previousVisitWithPeda: { peda: capture } } = this.props;
    const orphanedKeys = this.getOrphanedKeys();

    if (orphanedKeys.length > 0) {
      return (
        <div className={`row ${styles.orphanContainer}`} >
          <h3 className={styles.orphanHeader}>The following attributes will be cleared upon migration as they no longer exists on the new insturment  version:</h3>
          {orphanedKeys.map((k) =>
            <div key={k}>
              <p className={styles.orphanText}>Attribute: {k}</p>
              <p className={styles.orphanText}>Value: {capture.attributes[k]}</p>
            </div>
          )}
        </div>
      );
    }
  }

  render() {
    const {
      pedaInstrument,
      captureCreating,
    } = this.props;

    return (
      <div className="col col-xs-12" data-e2e="capture-create">
        { this.renderOrphans() }
        <Banner>
          <h1>Create Personal Data Capture</h1>
        </Banner>
        {pedaInstrument &&
          <div data-e2e="capture-create-wrapper">
            <DynamicForm
              data-e2e="subject-create-create-subject-form"
              form="createSubject"
              instrument={pedaInstrument}
              displayMode="createform"
              onSubmit={this.submitCapture}
              onCancel={this.goBack}
              validate={createValidator(pedaInstrument.capture_attribute_definitions)}
              loading={captureCreating}
              submitContent="Create"
              initialValues={this.prepareInitialValues()}
             />
          </div>
        }
      </div>
    );
  }
}

const PedaCreateForm = connect(mapStateToProps, mapDispatchToProps)(_PedaCreateForm);

export default PedaCreateForm;

