export const getSubjects = (state) => resolvePath(state, 'subjects.data.items');

export const getEditCaptureId = (state) => resolvePath(state, 'views.editCapture.captureId');
export const getAllCaptures = (state) => resolvePath(state, 'captures.data.items');
export const getAllInstruments = (state) => resolvePath(state, 'instruments.data.items');
export const getCaptureIsUpdating = (state) => resolvePath(state, 'captures.status.updating');

export const getCreateCaptureSubject = createSelector(
  getCreateCaptureSubjectId,
  getSubjects,
  (id, subjects) => {
    if (id) {
      return subjects[id];
    }
  }
);

export const getEditCapture = createSelector(
  getEditCaptureId,
  getAllCaptures,
  (editId, captures) => captures[editId]
);

export const getEditCaptureInstrument = createSelector(
  getEditCapture,
  getAllInstruments,
  ({ instrument_key, instrument_version }, instruments) => instruments[instrument_key][instrument_version]
);

