import resolvePath from 'object-resolve-path';
import { createSelector } from 'reselect';
import moment from 'moment';
import { getSubjectVisits } from './visitSelectors';

export const getProfileSubjectId = (state) => resolvePath(state, 'views.profile.subject');
export const isProfileLoading = (state) => resolvePath(state, 'views.profile.loading');
export const getSubjects = (state) => resolvePath(state, 'subjects.data.items');
export const getVisits = (state) => resolvePath(state, 'visits.data.items');
export const getCaptures = (state) => resolvePath(state, 'captures.data.items');
export const getVisitFilter = (state) => resolvePath(state, 'form.profileFilterToggle.values.filterVisits');

export const getProfileSubject = createSelector(
  getProfileSubjectId,
  getSubjects,
  (subjectId, subjects) => subjects[subjectId]
);

export const getProfileSubjectVisits = createSelector(
  getProfileSubjectId,
  getVisits,
  (subjectId, visits) => {
    const subjectVisits = {};

    Object.values(visits).forEach((visit) => {
      if (visit.subject_id === subjectId) {
        subjectVisits[visit.id] = visit;
      }
    });
    return subjectVisits;
  });

export const getTodaysVisit = (subjectId) => createSelector(
  getSubjectVisits(subjectId),
  (subjectVisits) => {
    const today = moment().format('MMDDYYYY');

    const visitProspect = subjectVisits.reduce((result, visit) => {
      if (moment(visit.attributes.visit_date).format('MMDDYYYY') === today) {
        result = visit;
      }
      return result;
    }, {});

    if (!visitProspect.id) {
      return null;
    }
    return visitProspect;
  }
);

export const getSubjectVisitsWithData = createSelector(
  getProfileSubjectId,
  getProfileSubjectVisits,
  getCaptures,
  (subjectId, subjectVisits, captures) => {
    Object.keys(captures).forEach((captureId) => {
      const capture = captures[captureId];

      // Is this the profile users capture?
      if (capture.subject_id === subjectId) {
        // Store capture to visit
        subjectVisits[capture.visit_id] = {
          ...subjectVisits[capture.visit_id],
          [capture.instrument_key]: capture
        };
      }
    });


    return Object.values(subjectVisits).sort((a, b) => (resolvePath(b, 'attributes.visit_date') > resolvePath(a, 'attributes.visit_date') ? 1 : -1));
  }
);

export const getSubjectVisitsWithDataMinusToday = createSelector(
  getSubjectVisitsWithData,
  (subjectVisitsWithData) => {
    const today = moment().format('MMDDYYYY');

    return subjectVisitsWithData.reduce((acc, visit) => {
      if (moment(visit.attributes.visit_date).format('MMDDYYYY') !== today) {
        acc.push(visit);
      }
      return acc;
    }, []);
  }
);

export const getTodaysVisitWithData = createSelector(
  getSubjectVisitsWithData,
  (subjectVisitsWithData) => {
    const today = moment().format('MMDDYYYY');

    const visitProspect = subjectVisitsWithData.reduce((result, visit) => {
      if (moment(visit.attributes.visit_date).format('MMDDYYYY') === today) {
        result = visit;
      }
      return result;
    }, {});

    if (!visitProspect.id) {
      return null;
    }
    return visitProspect;
  }
);

export const getMostRecentVisitWithPedaData = createSelector(
  getSubjectVisitsWithData,
  (visits) => {
    // since getSubjectVisitsWithData is already date sorted
    // we should be able to just .find this first match
    const mostRecentWithPeda = visits.find((visit) =>
      visit.peda
    );

    if (!mostRecentWithPeda) {
      return null;
    }
    return mostRecentWithPeda;
  }
);

