import { duckFactory } from '@nike/mother-goose';
import bodybuilder from 'bodybuilder';

const options = {
  apiPath: '/captures',
  moduleName: 'captures',
};

const captures = duckFactory(options);

export const createCapture = captures.async.create;
export const updateCapture = captures.async.update;
export const searchCaptures = captures.async.postSearch;

export const loadCapturesByVisitIds = (visitIds) => (dispatch) => {
  const body = bodybuilder().filter('terms', 'visit_id', visitIds).build();

  return dispatch(searchCaptures(body));
};

export const loadSubjectCaptures = (subjectId) => searchCaptures(
  bodybuilder()
    .filter('term', 'subject_id', subjectId)
    .filter('terms', 'instrument_key', ['peda', 'body_lab_processed'])
  .build()
);

// Export the reducer as default
export default captures.reducer;

