import React, { Component, PropTypes } from 'react';
import { connect } from 'react-redux';
import { Banner } from '@nike/lipstick';
import { browserHistory } from 'react-router';
import DynamicForm, { createValidator } from '@nike/outfielder';
import { captureSelectors } from 'state/selectors';
import * as captureActions from 'state/modules/captures';
import { getLastLocation } from 'state/selectors/locationSelectors';

export const mapStateToProps = (state) => ({
  captureToEdit: captureSelectors.getEditCapture(state),
  captureUpdating: captureSelectors.getCaptureIsUpdating(state),
  lastLocation: getLastLocation(state),
  pedaInstrument: captureSelectors.getEditCaptureInstrument(state),
  user: state.auth.user,
  userOrg: state.auth.userOrg,
});

export const mapDispatchToProps = {
  updateCapture: captureActions.updateCapture
};

class _PedaUpdateForm extends Component {
  static propTypes = {
    captureToEdit: PropTypes.object.isRequired,
    captureUpdating: PropTypes.bool.isRequired,
    lastLocation: PropTypes.string.isRequired,
    pedaInstrument: PropTypes.object,
    updateCapture: PropTypes.func.isRequired,
  }

  goBack = () => {
    const { lastLocation } = this.props;

    browserHistory.push(lastLocation);
  }

  submitCapture = (values) => {
    const {
      captureToEdit,
      captureToEdit: { id },
      updateCapture
    } = this.props;

    const data = {
      ...captureToEdit,
      attributes: { ...values }
    };

    updateCapture(id, data).then(() => {
      browserHistory.push('/subject');
    });
  }

  render() {
    const {
      captureToEdit,
      captureUpdating,
      pedaInstrument
    } = this.props;

    return (
      <div className="col col-xs-12" data-e2e="capture-update">
        <Banner>
          <h1>Update Personal Data Capture</h1>
        </Banner>
        {pedaInstrument &&
          <div data-e2e="capture-update-wrapper">
            <DynamicForm
              data-e2e="subject-update-capture-form"
              form="subjectCaptureUpdate"
              instrument={pedaInstrument}
              displayMode="createform"
              onSubmit={this.submitCapture}
              onCancel={this.goBack}
              validate={createValidator(pedaInstrument.capture_attribute_definitions)}
              loading={captureUpdating}
              submitContent="Update"
              initialValues={captureToEdit.attributes}
             />
          </div>
        }
      </div>
    );
  }
}

const PedaUpdateForm = connect(mapStateToProps, mapDispatchToProps)(_PedaUpdateForm);

export default PedaUpdateForm;

