import React, { Component, PropTypes } from 'react';
import { connect } from 'react-redux';
import { SecondaryButton } from '@nike/ruxac';
import { setTriggeredControl } from 'state/modules/objViewer';

class _ResetRotateControls extends Component {
  static propTypes = {
    dispatch: PropTypes.func.isRequired,
    SceneController: PropTypes.object.isRequired
  }

  toggleAutoRotate = () => {
    const { dispatch, SceneController: { MapModel: { scene } } } = this.props;

    // dispatching directly as this is purely for analytics
    // this isn't flowing thru update so send a str
    dispatch(setTriggeredControl('CONTROL_TYPE_AUTOROTATE'));
    scene.toggleAutoRotate();
  }

  reset = () => {
    const { dispatch, SceneController } = this.props;

    // dispatching directly as this is purely for analytics
    // this isn't flowing thru update so send a str
    dispatch(setTriggeredControl('CONTROL_TYPE_RESET'));
    SceneController.reset();
  }

  render() {
    return (
      <div className="controlGroup">
        <SecondaryButton
          className="controlButton"
          onClick={this.toggleAutoRotate}
          style={{ zIndex: 'auto' }}
          tooltip="Auto Rotate">
          <svg>
            <use xlinkHref="#circle" />
          </svg>
        </SecondaryButton>
        <SecondaryButton
          className="controlButton"
          onClick={this.reset}
          style={{ zIndex: 'auto' }}
          tooltip="Reset">
          <svg>
            <use xlinkHref="#rest" />
          </svg>
        </SecondaryButton>
      </div>
    );
  }
}

const ResetRotateControls = connect()(_ResetRotateControls);

export default ResetRotateControls;

