/**
 * ResourceImage
 * An image component that connects with the store
 * to load resources as needed to ensure proper display.
 */
import React, { Component, PropTypes } from 'react';
import { connect } from 'react-redux';
// If we decide to check the validity of the AWS url, we'll need to GET the download_url for status
// import superagent from 'superagent';
import * as resourceLoaderActions from '../../state/modules/resourceLoader';
import { getResourceById } from '../../state/selectors/resourceLoaderSelectors';
import styles from './ResourceImage.scss';

const mapStateToProps = (state, props) => ({
  resource: getResourceById(props.resourceId)(state)
});

const mapDispatchToProps = {
  loadResource: resourceLoaderActions.loadResource
};

export class _ResourceImage extends Component {
  static propTypes = {
    // Whether to display as a bgImage
    bgImage: PropTypes.bool.isRequired,
    // Pass this prop when using this component
    resourceId: PropTypes.number.isRequired,
    // These will come from connect
    resource: PropTypes.object,
    loadResource: PropTypes.func.isRequired
  }

  static defaultProps = {
    bgImage: false
  }

  componentDidMount() {
    const { loadResource, resourceId, resource } = this.props;

    if (!resource) {
      // No resource in store
      loadResource(resourceId);
    } else if (!resource.loading && !resource.download_url) {
      // No download_url for resource
      loadResource(resourceId);
    }
      //  else {
      //   Has the download_url expired?
      //   TODO: Check that the download_url is still valid and reload if not
      // }
  }

  render() {
    const { bgImage, resource } = this.props;

    if (!resource || resource.loading) {
      return (
        <div className={styles.resourceImage}>
          <i className="fa fa-spinner fa-spin" data-e2e="resource-image-spinner" />
        </div>
      );
    }

    if (bgImage) {
      return (
        <div
          className="resource-image resource-bg-image"
          style={{ backgroundImage: `url(${resource.download_url})` }}
        />
      );
    }

    return (
      <img
        className="resource-image resource-img-image"
        data-e2e="resource-image"
        src={resource.download_url}
        alt={resource.name}
      />
    );
  }
}

const ResourceImage = connect(mapStateToProps, mapDispatchToProps)(_ResourceImage);

export default ResourceImage;

