// this duck is here expressly to manage altea actions/state
import { viewDuckFactory } from '@nike/mother-goose';
import { push } from 'react-router-redux';
import { loadSubject } from './subjects';
import { loadSubjectProfileData, setProfileSubject } from './profile';

const initialState = {
  promptOpen: false,
  subjectId: null,
  visitId: null,
  captureId: null,
  subject: null,
  shouldNavigate: false
};

export const altea = viewDuckFactory('altea', initialState);

export const completeScan = (data, subject) => altea.sync.set({ promptOpen: true, subjectId: data.subject_id, visitId: data.visit_id, captureId: data.capture_id, subject });

export const completeScanAndLoadSubject = (data) => (
  (dispatch) => {
    const { subject_id: subjectId } = data;

    let subject = {};

    return dispatch(loadSubject(subjectId))
      .then((res) => {
        subject = res;

        return dispatch(loadSubjectProfileData(subjectId));
      }).then(() => dispatch(completeScan(data, subject)));
  }
);

export const closePrompt = () => altea.sync.set({ promptOpen: false });
export const setShouldNavigate = (bool) => altea.sync.set({ shouldNavigate: bool });
export const completeNavigate = () => altea.sync.set({ initialState });

export const navigateTo = () => (
  (dispatch, getState) => {
    const { views: { altea: { subjectId } } } = getState();

    dispatch(setProfileSubject(subjectId));
    dispatch(push('/subject'));
  }
);

export default altea.reducer;

