import { viewDuckFactory } from '@nike/mother-goose';
import { loadSubjectCaptures } from './captures';
import { loadSubjectVisits } from './visits';

const SUBJECT_PROFILE_REQUEST = 'profile/SUBJECT_PROFILE_REQUEST';
const SUBJECT_PROFILE_SUCCESS = 'profile/SUBJECT_PROFILE_SUCCESS';
const SUBJECT_PROFILE_ERROR = 'profile/SUBJECT_PROFILE_ERROR';

const initialState = {
  error: false,
  errorMessage: null,
  loading: false,
  subject: null
};

export const profile = viewDuckFactory('profile', initialState);

export const setProfileSubject = (id) => profile.sync.set({ subject: id });

/**
 * Async action to wrap loading all necessary subject profile data.
 */
export const loadSubjectProfileData = (subjectId) => ({
  types: [SUBJECT_PROFILE_REQUEST, SUBJECT_PROFILE_SUCCESS, SUBJECT_PROFILE_ERROR],
  promise: (client, dispatch) =>
    dispatch(loadSubjectVisits(subjectId)).then(() =>
      dispatch(loadSubjectCaptures(subjectId))
    )
});

const reducer = (state = initialState, action = {}) => {
  switch (action.type) {
    case SUBJECT_PROFILE_REQUEST:
      return {
        ...state,
        loading: true
      };
    case SUBJECT_PROFILE_SUCCESS:
      return {
        ...state,
        loading: false,
        error: false
      };
    case SUBJECT_PROFILE_ERROR:
      return {
        ...state,
        loading: false,
        error: true,
        errorMessage: action.error
      };
    default:
      return profile.reducer(state, action);
  }
};

export default reducer;

