// import * as subjectActions from '../../state/modules/subjects';
import { getSubjectPhotoId } from '../../state/selectors/subjectSelectors';
import styles from './SubjectAvatar.scss';

const mapStateToProps = (state, props) => ({
  subject: props.subject
});
const mapDispatchToProps = {
};

class _SubjectAvatar extends Component {
  static propTypes = {
    subject: PropTypes.object
  }

  renderImageContent = () => {
    const { subject } = this.props;

    // Do we have a subject?
    if (subject) {
      // Does the subject have a subject_photo?
      const subjectPhotoId = getSubjectPhotoId(subject);

      if (subjectPhotoId) {
        // Render ResourceImage
        return <ResourceImage resourceId={subjectPhotoId} bgImage />;
      }
    }

    // Render Avatar
    return <i className="fa fa-user fa-3x" />;
  }

  render() {
    return (
      <div className={`subject-avatar ${styles.subjectAvatar}`}>
        {this.renderImageContent()}
      </div>
    );
  }
}

const SubjectAvatar = connect(mapStateToProps, mapDispatchToProps)(_SubjectAvatar);

export default SubjectAvatar;

