import React, { PropTypes } from 'react';
import moment from 'moment';
import { SubjectAvatar } from 'components';
import { getSubjectAge } from 'state/dataAdapters';
import styles from './SubjectHeader.scss';

const SubjectHeader = ({ editSubject, subject }) => (
  <div
    data-e2e="confirm-visit-card"
    className={`${styles.confirmVisit__header} row pad-2`}>
    {editSubject &&
      <div
        data-e2e="confirm-visit-edit-wrapper"
        className={styles.confirmVisit__edit}>
        <a onClick={editSubject} tabIndex={0}>
          <i className="fa fa-pencil" />
        </a>
      </div>
    }
    <div
      data-e2e="confirm-visit-subject"
      className={`${styles.confirmVisit__subject} col-xs-12`}>
      <div
        data-e2e="confirm-visit-avatar"
        className={`${styles.confirmVisit__avatar}`}>
        <SubjectAvatar subject={subject} />
      </div>

      <h1
        data-e2e="confirm-visit-subject-name"
        className="marg--none marg--top-h">
        {`${subject.attributes.last_name}, ${subject.attributes.first_name}`}
      </h1>
      <p
        data-e2e="confirm-visit-subject-date-of-birth"
        className="marg--none">
        {`${moment(subject.attributes.date_of_birth).format('YYYY/MM/DD')} - Age ${getSubjectAge(subject.attributes.date_of_birth)} - ${subject.attributes.gender}`}
      </p>
    </div>
    <div
      data-e2e="confirm-visit-user-metrics"
      className={`confirmVisit__user-metrics col-xs-12 marg--top-2 ${styles.hidden}`}>
      hidden field for user self reported metrics
    </div>
  </div>
);

SubjectHeader.propTypes = {
  editSubject: PropTypes.func,
  subject: PropTypes.object.isRequired
};

export default SubjectHeader;

