import moment from 'moment';

const formatAge = (preparedDOB) => moment().diff(moment(preparedDOB, 'YYYYMMDD'), 'years');

export const getSubjectAge = (DOB) => {
  const preparedDOB = moment.utc(DOB).format('YYYYMMDD');

  return formatAge(preparedDOB);
};

export const getStudyDisplayId = (item) => (item.attributes.study_id
    ? `N${item.attributes.study_id}`
    : item.attributes.study_accession_id);

export const getStudyDisplayTitle = (item) =>
  `${getStudyDisplayId(item)} -- ${item.attributes.study_title}`;

