import React, { Component, PropTypes } from 'react';
import DropZone from 'react-dropzone';
import { ResourceImage } from '../../components';
import styles from './SubjectPhotoUploader.scss';

export default class SubjectPhotoUploader extends Component {
  static propTypes = {
    addFile: PropTypes.func.isRequired,
    resourceId: PropTypes.number,
    resourceFile: PropTypes.object,
    resourceFileSrc: PropTypes.string
  }

  renderPhotoContent = () => {
    const {
      resourceId,
      resourceFile,
      resourceFileSrc,
    } = this.props;

    // Do we have a loaded file?
    if (resourceFile) {
      return (
        <div className={styles.subjectPhoto} style={{ backgroundImage: `url(${resourceFileSrc})` }} />
      );
    }
    // Do we have an existing resource?
    if (resourceId) {
      return (
        <ResourceImage resourceId={resourceId} bgImage />
      );
    }

    // Return Blank Avatar
    return (
      <div className="no-image" data-e2e="subject-photo-uploader-no-image">
        <i className="fa fa-user" data-e2e="subject-photo-uploader-no-user" />
      </div>
    );
  }

  render() {
    const { addFile } = this.props;

    return (
      <DropZone
        className={styles.subjectPhotoUploader}
        data-e2e="subject-photo-uploader-dropzone"
        multiple={false}
        onDrop={addFile}
        accept="image/*"
      >
        <div className={styles.avatar} data-e2e="subject-photo-uploader-avatar">
          {this.renderPhotoContent()}
        </div>
        <h4 data-e2e="subject-photo-uploader-subject-photo">Subject Photo</h4>
        <h5>(Click to add subject photo)</h5>
      </DropZone>
    );
  }
}

