import React, { Component, PropTypes } from 'react';
import resolvePath from 'object-resolve-path';
import { connect } from 'react-redux';
import glamorous from 'glamorous';
import { Spinner } from '@nike/ruxac';
import { ProfileFilterToggle, SubjectProfileListItem } from 'components';
import * as profileActions from 'state/modules/profile';
import { profileSelectors } from 'state/selectors';
import { defaultStyle } from './SubjectProfileList.style';

export const mapStateToProps = (state) => ({
  filterVisits: !!resolvePath(state, 'form.profileFilterToggle.values.filterVisits'),
  subjectVisits: profileSelectors.getSubjectVisitsWithDataMinusToday(state),
  visitsSearching: state.visits.status.searching
});

export const mapDispatchToProps = {
  setVisitFilter: profileActions.setVisitFilter
};

export class _SubjectProfileList extends Component {
  static propTypes = {
    className: PropTypes.string.isRequired,
    filterVisits: PropTypes.bool,
    subjectVisits: PropTypes.array.isRequired,
    visitsSearching: PropTypes.bool
  };

  renderList = () => {
    const {
      filterVisits,
      subjectVisits,
      visitsSearching
    } = this.props;

    if (visitsSearching) {
      return (
        <Spinner data-e2e="subject-profile-list-spinner" />
      );
    } else if (subjectVisits.length) {
      return (
        <div className="subject-search-results">
          {subjectVisits.reduce((visitList, visit) => {
            if (!filterVisits || (visit.peda || visit.body_lab_processed)) {
              visitList.push(
                <div key={`subject-profile-list-item-${visit.id}`}>
                  <SubjectProfileListItem visit={visit} />
                </div>
              );
            }
            return visitList;
          }, [])}
        </div>
      );
    } else if (subjectVisits.length === 0) {
      // No results message
      return (
        <div className="noSubjectsFound" data-e2e="subject-profile-list">
          <h3 data-e2e="subject-profile-list-title">No Previous Visits Found</h3>
        </div>
      );
    }
  }

  render() {
    const {
      className,
     subjectVisits
    } = this.props;

    return (
      <div className={className} data-e2e="subject-profile-list">
        {subjectVisits && subjectVisits.length > 0 ? (
          <div className="row">
            <div className="col-xs-6">
              <h1 data-e2e="subject-profile-list-title">Previous Visits Found [{subjectVisits.length}]</h1>
            </div>
            <div className="col-xs-6">
              <div style={{ display: 'flex', height: '100%' }}>
                <div style={{ alignSelf: 'center', textAlign: 'right', width: '100%' }}>
                  <div style={{ display: 'inline-block' }}>
                    <ProfileFilterToggle />
                  </div>
                </div>
              </div>
            </div>
          </div>
        ) : null}
        <div data-e2e="subject-profile-list-wrapper">
          {this.renderList()}
        </div>
      </div>
    );
  }
}

const SubjectProfileList = connect(mapStateToProps, mapDispatchToProps)(glamorous(_SubjectProfileList)(defaultStyle));

export default SubjectProfileList;

