import React, { Component, PropTypes } from 'react';
import { connect } from 'react-redux';
import moment from 'moment';
import Scroll from 'react-scroll';
import { PedaData, ViewPane } from 'components';
import { profileSelectors, alteaSelectors } from 'state/selectors';
import { getVisitDataResourceId } from 'helpers/utils';
import { isElectron } from 'helpers/electron';
import * as alteaActions from 'state/modules/altea';
import scanIcon from './bodyscan-icon.svg';
import styles from './SubjectProfileListItem.scss';

export const mapStateToProps = (state) => ({
  subject: profileSelectors.getProfileSubject(state),
  alteaVisitId: alteaSelectors.getProcessedVisitId(state),
  shouldNavigate: alteaSelectors.getShouldNavigate(state)
});

export const mapDispatchToProps = {
  setShouldNavigate: alteaActions.setShouldNavigate
};

export class _SubjectProfileListItem extends Component {
  static propTypes = {
    visit: PropTypes.object.isRequired,
    alteaVisitId: PropTypes.number,
    shouldNavigate: PropTypes.bool.isRequired,
    setShouldNavigate: PropTypes.func.isRequired
  };

  constructor(props) {
    super(props);

    this.state = {
      expanded: false,
      shouldScroll: true
    };
  }

  componentDidMount() {
    if (isElectron()) {
      const { visit: { body_lab_processed: bodyLabProcessed } } = this.props;

      if (document.readyState === 'complete' && bodyLabProcessed) {
        this.handleScrollTo();
      }
    }
  }

  componentWillReceiveProps(nextProps) {
    if (isElectron()) {
      const { alteaVisitId, visit: { id } } = this.props;
      const { alteaVisitId: nextAlteaVisitId } = nextProps;

      if (alteaVisitId !== nextAlteaVisitId && nextAlteaVisitId === id) {
        this.setState({ shouldScroll: true });
      }
    }
  }

  componentDidUpdate() {
    if (isElectron()) {
      const { visit: { body_lab_processed: bodyLabProcessed } } = this.props;
      const { shouldNavigate } = this.props;
      const { shouldScroll } = this.state;

      if (shouldScroll && shouldNavigate && bodyLabProcessed) {
        this.handleScrollTo();
      }
    }
  }

  toggleExpand = (pedaOrScan) => () => {
    const { expanded } = this.state;

    this.setState({
      expanded: pedaOrScan === expanded ? false : pedaOrScan
    });
  }

  handleScrollTo = () => {
    const { alteaVisitId, visit: { id }, setShouldNavigate } = this.props;

    if (alteaVisitId === id) {
      if (!this.node) return;
      const scroller = Scroll.animateScroll;

      this.setState({ expanded: 'body_lab_processed', shouldScroll: false });
      setShouldNavigate(false);

      const top = this.node.offsetTop;

      scroller.scrollTo(top, {
        duration: 1000,
        containerId: 'body',
        smooth: 'easeInOutQuint'
      });
    }
  }

  render() {
    const {
      visit
    } = this.props;
    const { expanded } = this.state;
    const bodyScanId = getVisitDataResourceId(visit, 'body_lab_processed');
    const pedaFileId = getVisitDataResourceId(visit, 'peda');

    return (
      <div ref={node => { this.node = node; }} className="row">
        <div className="col-xs-12">
          <div
            className={`${styles.subject__searchResultItem} row`}
            data-e2e="subject-profile-list-item-visit">
            <div
              className={`${styles.subject__cardHeader} col-xs-6`}
              data-e2e="subject-profile-list-item-info">
              <div className={`${styles.visit__date} col-xs-4`}>
                <h1 className={styles.visit__day}>
                  {`${moment(visit.attributes.visit_date).format('DD')} ${moment(visit.attributes.visit_date).format('MMM')}`}
                </h1>
                <h1 className={styles.visit__month}>
                  {moment(visit.attributes.visit_date).format('YYYY')}
                </h1>
              </div>
              <div className={`${styles.subject__subjectProfile} col-xs-8`}>
                <h2>
                  VISIT LABEL: <span className={styles.noCaps}>a{visit.id}</span>
                </h2>
              </div>
            </div>
            <div
              className={`${styles.visit__scanIconWrapper} col-xs-3`}
              data-e2e="subject-profile-list-item-peda-link"
              style={expanded === 'peda' ? { backgroundColor: 'rgba(0,0,0,0.1)' } : {}}
            >
              {visit.peda &&
                <a
                  tabIndex="0"
                  onClick={this.toggleExpand('peda')}
                  className={expanded === 'peda' ? 'expanded' : ''}
                  >
                  PERSONAL<br />
                  DATA
                </a>
              }
            </div>
            <div
              className={`${styles.visit__scanIconWrapper} col-xs-3`}
              data-e2e="subject-profile-list-item-bodyscan-dude"
              style={expanded === 'body_lab_processed' ? { backgroundColor: 'rgba(0,0,0,0.1)' } : {}}
            >
              {visit.body_lab_processed &&
                <a
                  tabIndex="0"
                  onClick={this.toggleExpand('body_lab_processed')}
                  className={expanded === 'body_lab_processed' ? 'expanded' : ''}
                >
                  <img className={styles.visit__scanIcon} src={scanIcon} />
                </a>
              }
            </div>
          </div>
          {expanded === 'peda' &&
            <PedaData data={visit.peda} resourceId={pedaFileId} />
          }
          {expanded === 'body_lab_processed' &&
            <ViewPane
              selector={`preview__${visit.id.toString()}`}
              resourceId={bodyScanId}
              bodyLabProcessed={visit.body_lab_processed} />
          }
        </div>
      </div>
    );
  }
}

const SubjectProfileListItem = connect(mapStateToProps, mapDispatchToProps)(_SubjectProfileListItem);

export default SubjectProfileListItem;

