/**
 * Extract processed body scan resource id
 * from a visitWithData
 * @param {object} visit - the visitWithData
 * @param {string} dataKey - the data key on the visitWithData
 */
export const getVisitDataResourceId = (visit, dataKey) => {
  if (!visit[dataKey]) {
    return null;
  }
  if (visit[dataKey].resources.length === 0) {
    return null;
  }
  return visit[dataKey].resources.find(res => res.id !== null).id;
};

