import React, { Component, PropTypes } from 'react';
import resolvePath from 'object-resolve-path';
import { reduxForm, Field } from 'redux-form';
import { FieldInput } from '@nike/outfielder';
import { Banner } from '@nike/lipstick';
import { connect } from 'react-redux';
import bodybuilder from 'bodybuilder';
import debounce from 'lodash/debounce';
import * as subjectSearchActions from 'state/modules/subjectSearch';
import * as subjectActions from '../../state/modules/subjects';
import styles from './SubjectSearchForm.scss';


export const preprocessSearchInput = (userInput = '') => {
  const s = userInput.toLowerCase().trim().replace(/\s+/g, ' ');

  if (s === '') {
    return [];
  }

  return s.split(' ');
};

export const mapStateToProps = (state) => ({
  isSearching: resolvePath(state, 'subjects.status.searching'),
  subjectSearchForm: state.form.subjectSearch,
});

export const mapDispatchToProps = {
  searchSubjects: subjectActions.searchSubjects,
  setFoundSubjects: subjectSearchActions.setFoundSubjects,
  setLastSearched: subjectSearchActions.setLastSearched
};

export class _SubjectSearchForm extends Component {
  static propTypes = {
    handleSubmit: PropTypes.func,
    searchSubjects: PropTypes.func.isRequired,
    setFoundSubjects: PropTypes.func.isRequired,
    setLastSearched: PropTypes.func.isRequired
  };

  search = (userInput) => {
    const {
      searchSubjects,
      setFoundSubjects,
      setLastSearched
    } = this.props;
    const subjectBody = bodybuilder();

    // Trim white space and split user input into search terms
    const searchTerms = preprocessSearchInput(userInput);

    subjectBody.filter('match', 'instrument_key', 'subject');

    // Search each term for first/last name
    searchTerms.forEach((term) => {
      subjectBody.orFilter('prefix', 'attributes.last_name', term);
      subjectBody.orFilter('prefix', 'attributes.first_name', term);
    });

    if (searchTerms.length > 0) {
      searchSubjects(subjectBody.build()).then((foundSubjects) => {
        setFoundSubjects(foundSubjects.content.map(subject => subject.id));
      });
      setLastSearched(userInput);
    }
  }

  handleSearchOnChange = debounce((event, value) => {
    // Do we have 3 or more characters?
    if (value.replace(/\s/g, '').length >= 3) {
      // are we not currently searching?
      this.search(value);
    }
  }, 300);

  searchOnSubmit = (values) => {
    this.search(values.subject_search);
  }

  render() {
    const { handleSubmit } = this.props;

    return (
      <form
        className={styles.subjectSearchForm}
        onSubmit={handleSubmit(this.searchOnSubmit)}
        data-e2e="subject-search-form">
        <Banner e2e="subject-search-banner">
          <h3 data-e2e="banner-overlay">Search Subjects</h3>
        </Banner>
        <Field
          data-e2e="subject-search-input"
          component={FieldInput}
          name="subject_search"
          onChange={this.handleSearchOnChange}
        />
      </form>
    );
  }
}

const SubjectSearchForm = reduxForm({
  form: 'subjectSearch',
  destroyOnUnmount: false,
})(_SubjectSearchForm);

export default connect(mapStateToProps, mapDispatchToProps)(SubjectSearchForm);

