import React, { Component, PropTypes } from 'react';
import resolvePath from 'object-resolve-path';
import { connect } from 'react-redux';
import { Link } from 'react-router';
import glamorous from 'glamorous';
import { Spinner } from '@nike/ruxac';
import { SubjectSearchResultItem } from 'components';
import { subjectSearchSelectors } from 'state/selectors';
import { defaultStyle } from './SubjectSearchResultList.style';

export const mapStateToProps = (state) => ({
  subjectSearchResults: resolvePath(state, 'views.subjectSearch.subjects'),
  displaySubjectCreate: subjectSearchSelectors.displaySubjectCreate(state),
  subjectSearching: state.subjects.status.searching || state.visits.status.searching,
});

export const mapDispatchToProps = {};

export class _SubjectSearchResultList extends Component {
  static propTypes = {
    className: PropTypes.string.isRequired,
    displaySubjectCreate: PropTypes.bool,
    subjectSearching: PropTypes.bool.isRequired,
    subjectSearchResults: PropTypes.array.isRequired
  };

  getSearchResultItems = () => {
    const {
      displaySubjectCreate,
      subjectSearching,
      subjectSearchResults
    } = this.props;

    if (subjectSearching) {
      return (
        <Spinner data-e2e="search-result-list-spinner" />
      );
    } else if (subjectSearchResults.length) {
      return (
        <div className="subject-search-results">
          {subjectSearchResults.map((subjectId) => (
            <div key={`subject-search-result-item-${subjectId}`}>
              <SubjectSearchResultItem subjectId={subjectId} />
            </div>
          ))}
        </div>
      );
    } else if (subjectSearchResults.length === 0 && displaySubjectCreate) {
      // No results message
      return (
        <div className="noSubjectsFound" data-e2e="search-result-list">
          <h3 data-e2e="search-result-list-title">No Subjects Found</h3>
        </div>
      );
    }
  }

  render() {
    const {
      className,
       displaySubjectCreate,
       subjectSearchResults
     } = this.props;

    return (
      <div className={className} data-e2e="search-result-list">
        {subjectSearchResults && subjectSearchResults.length > 0 ?
          <h1 data-e2e="search-result-list-title">Subjects Found [{subjectSearchResults.length}]</h1> : null
        }
        <div data-e2e="search-result-list-wrapper">
          {this.getSearchResultItems()}
        </div>
        {
          displaySubjectCreate &&
          <div style={{ textAlign: 'center' }}>
            <p style={{ opacity: '.4' }}>not the subject you're looking for?</p>
            <Link
              to="/subject/create"
              data-e2e="search-result-list-button-create-subject"
              style={{
                textDecoration: 'underline',
                color: 'rgb(47,232,149)'
              }}>
              Create a New Subject
            </Link>
          </div>
        }
      </div>
    );
  }
}

const SubjectSearchResultList = connect(mapStateToProps, mapDispatchToProps)(glamorous(_SubjectSearchResultList)(defaultStyle));

export default SubjectSearchResultList;

