import React, { Component, PropTypes } from 'react';
import { browserHistory } from 'react-router';
import { IconButton, PrimaryButton } from '@nike/ruxac';
import { connect } from 'react-redux';
import glamorous from 'glamorous';
import * as profileActions from 'state/modules/profile';
import * as subjectEditActions from 'state/modules/subjectEdit';
import { getSubjectAge } from 'state/dataAdapters';
import { subjectSelectors } from 'state/selectors';
import { SubjectAvatar } from '../';
import { defaultStyle } from './SubjectSearchResultItem.style';

export const mapStateToProps = (state, props) => ({
  subject: subjectSelectors.getSubject(props.subjectId)(state),
});

export const mapDispatchToProps = {
  setProfileSubject: profileActions.setProfileSubject,
  setSubjectToEdit: subjectEditActions.setSubjectToEdit
};

export class _SubjectSearchResultItem extends Component {
  static propTypes = {
    className: PropTypes.string.isRequired,
    setProfileSubject: PropTypes.func.isRequired,
    setSubjectToEdit: PropTypes.func.isRequired,
    subjectId: PropTypes.number.isRequired,
    subject: PropTypes.object.isRequired
  };

  editSubject = () => {
    const { subject: { id }, setSubjectToEdit } = this.props;

    // Set Subject to edit
    setSubjectToEdit(id);
    // Route to subject/edit
    browserHistory.push('/subject/edit');
  }

  handleSelect = () => {
    const {
      setProfileSubject,
      subjectId,
    } = this.props;

    setProfileSubject(subjectId);

    browserHistory.push('/subject');
  }

  render() {
    const {
      className,
      subject,
      subjectId
    } = this.props;

    return (
      <div
        className={`${className} row`}
        data-e2e="subject-search-result-item-subject">
        <div
          className="subject__cardHeader col-xs-7"
          data-e2e="subject-search-result-item-study-card">
          <div className="subjectAvatar">
            <SubjectAvatar subject={subject} subjectId={subjectId} />
          </div>
          <div className="subject__subjectProfile">
            <span> {`${subject.attributes.first_name} ${subject.attributes.last_name}`} </span>
            <span className="attribute"> {`Age: ${getSubjectAge(subject.attributes.date_of_birth)}`} </span>
            {subject.attributes.email &&
              <span className="attribute">Email: {subject.attributes.email}</span>
            }
          </div>
        </div>
        <div
          className="subject__buttonWrapper col-xs-3"
          data-e2e="subject-search-result-item-button-edit-wrapper">
          <IconButton
            iconClassName="fa fa-2x fa-pencil"
            iconStyle={{ color: 'grey' }}
            onClick={this.editSubject}
          />
        </div>
        <div
          className="col-xs-2 subject__buttonWrapper"
          data-e2e="subject-search-result-item-button-select-wrapper">
          <PrimaryButton
            data-e2e="search-result-item-button-select-subject"
            className="checkInButton"
            onClick={this.handleSelect}>
              Select
          </PrimaryButton>
        </div>
      </div>
    );
  }
}

const SubjectSearchResultItem = connect(mapStateToProps, mapDispatchToProps)(glamorous(_SubjectSearchResultItem)(defaultStyle));

export default SubjectSearchResultItem;

