import React, { Component, PropTypes } from 'react';
import glamorous from 'glamorous';
import { DESTROY } from 'helpers/Three/SceneController';

import { defaultStyle } from './ThreeCanvas.style';

class ThreeCanvas extends Component {
  constructor(props) {
    super(props);
    this.initFromProps = this.initFromProps.bind(this);
  }

  componentDidMount() {
    this.initFromProps();
  }

  componentDidUpdate(prevProps) {
    if (prevProps.model !== this.props.model) {
      setTimeout(this.initFromProps, 50);
    }
  }

  componentWillUnmount() {
    this.props.SceneController.update(DESTROY);
  }

  initFromProps() {
    const { className, model, mouseTarget, progressCallback, selector, SceneController } = this.props;

    // last flag sets to auto-rotate (no controls, only a resize listener)
    SceneController.init(`.${className}.${selector}`, mouseTarget, model, true, progressCallback);
  }

  render() {
    const { className, selector } = this.props;

    return <div id="threed-container" className={`${className} ${selector}`} />;
  }
}

ThreeCanvas.propTypes = {
  className: PropTypes.string.isRequired,
  model: PropTypes.string.isRequired,
  mouseTarget: PropTypes.string.isRequired,
  progressCallback: PropTypes.func.isRequired,
  selector: PropTypes.string.isRequired,
  SceneController: PropTypes.any
};

export default glamorous(ThreeCanvas)(defaultStyle);

