import React, { Component, PropTypes } from 'react';
import { connect } from 'react-redux';
import { PrimaryButton, ProgressBar } from '@nike/ruxac';
import glamorous from 'glamorous';
import { ModeControls, ResetRotateControls, ThreeCanvas, ZoomControls } from 'components';
import * as resourceLoaderActions from 'state/modules/resourceLoader';
import { getResourceById } from 'state/selectors/resourceLoaderSelectors';
import SceneController from 'helpers/Three/SceneController';
import { defaultStyle } from './ViewPane.style';

const mapStateToProps = (state, props) => ({
  resource: getResourceById(props.resourceId)(state)
});

const mapDispatchToProps = {
  loadResource: resourceLoaderActions.loadResource
};

class _ViewPane extends Component {
  // See atlas for a non auto-rotate example of this stuff should we ever want to
  // add additional controls etc - this has been stripped to bare-bones
  static propTypes = {
    bodyLabProcessed: PropTypes.object.isRequired,
    className: PropTypes.string.isRequired,
    loadResource: PropTypes.func.isRequired,
    resource: PropTypes.object,
    resourceId: PropTypes.number,
    selector: PropTypes.string.isRequired
  };

  constructor(props) {
    super(props);

    this.SceneController = new SceneController();
    this.state = {
      completed: 0
    };
  }

  componentDidMount() {
    const { loadResource, resource, resourceId } = this.props;

    if (!resource) {
      loadResource(resourceId);
    } else if (!resource.loading && !resource.download_url) {
      loadResource(resourceId);
    }
  }

  updateProgress = (completed) => {
    if (completed > 100) {
      this.setState({ completed: 100 });
    } else {
      this.setState({ completed });
    }
  }

  renderMeasurements = () => {
    const { bodyLabProcessed: { attributes } } = this.props;
    // rounded attributes
    const rattrs = {};

    Object.keys(attributes).forEach((key) => {
      if (!attributes[key] || isNaN(attributes[key])) {
        rattrs[key] = attributes[key];
        return;
      }
      rattrs[key] = (attributes[key]).toFixed(2);
    });

    return (
      <div className="measurementPane">
        <p><b>Bust Girth:</b> {rattrs.bust_girth}</p>
        <p><b>Bust Height:</b> {rattrs.bust_height}</p>
        <p><b>Waist Girth:</b> {rattrs.waist_girth}</p>
        <p><b>Waist Height:</b> {rattrs.waist_height}</p>
        <p><b>Inseam Right:</b> {rattrs.inseam_right}</p>
        <p><b>Inseam Left:</b> {rattrs.inseam_left}</p>
        <p><b>Shirt Length:</b> {rattrs.shirt_length}</p>
        <p><b>Total Height:</b> {rattrs.total_height}</p>
      </div>
    );
  }

  render() {
    const { className, selector, resource, resourceId } = this.props;
    const mouseTarget = `.mapRenderer.${selector}`;

    if (!resourceId) {
      return (
        <div className={className}>
          <div className="mapWrapper">
            NO RESOURCE FOUND
          </div>
        </div>
      );
    }

    if (!resource || resource.loading) {
      return (
        <div className={className}>
          <div className="mapWrapper">
            <i className="fa fa-spinner fa-3x fa-spin" data-e2e="resource-obj-spinner" />
          </div>
        </div>
      );
    }

    return (
      <div className={className}>
        <div className="mapWrapper">
          <ProgressBar
            color="#fa5400"
            mode="determinate"
            value={this.state.completed} />
          <div className={`mapRenderer ${selector}`}>
            {this.renderMeasurements()}
            <ThreeCanvas
              model={resource.download_url}
              selector={selector}
              mouseTarget={mouseTarget}
              SceneController={this.SceneController}
              progressCallback={this.updateProgress} />
            <div className="controlPane">
              <ModeControls SceneController={this.SceneController} />
              <ZoomControls SceneController={this.SceneController} />
              <ResetRotateControls SceneController={this.SceneController} />
            </div>
          </div>
          <a target="_blank" download rel="noopener noreferrer" href={resource.download_url}>
            <PrimaryButton
              backgroundColor={'#fa5400'}>
                Download
            </PrimaryButton>
          </a>
        </div>
      </div>
    );
  }
}

const ViewPane = connect(mapStateToProps, mapDispatchToProps)(glamorous(_ViewPane)(defaultStyle));

export default ViewPane;

