import React, { Component, PropTypes } from 'react';
import { connect } from 'react-redux';
import { SecondaryButton } from '@nike/ruxac';
import { setTriggeredControl } from 'state/modules/objViewer';

class _ZoomControls extends Component {// = ({ SceneController }) => (
  static propTypes = {
    dispatch: PropTypes.func.isRequired,
    SceneController: PropTypes.object.isRequired
  }

  zoomIn = () => {
    const { dispatch, SceneController } = this.props;

    // dispatching directly as this is purely for analytics
    // this isn't flowing thru update so send a str
    dispatch(setTriggeredControl('CONTROL_TYPE_ZOOMIN'));
    SceneController.zoomIn();
  }

  zoomOut = () => {
    const { dispatch, SceneController } = this.props;

    // dispatching directly as this is purely for analytics
    // this isn't flowing thru update so send a str
    dispatch(setTriggeredControl('CONTROL_TYPE_ZOOMOUT'));
    SceneController.zoomOut();
  }

  render() {
    return (
      <div className="controlGroup">
        <SecondaryButton
          className="controlButton"
          disableTouchRipple
          id="zoom-in"
          onClick={this.zoomIn}
          style={{ zIndex: 'auto' }}
          tooltip="Zoom In">
          <svg>
            <use xlinkHref="#zoom-in" />
          </svg>
        </SecondaryButton>
        <SecondaryButton
          className="controlButton"
          disableTouchRipple
          id="zoom-out"
          onClick={this.zoomOut}
          style={{ zIndex: 'auto' }}
          tooltip="Zoom Out">
          <svg>
            <use xlinkHref="#zoom-out" />
          </svg>
        </SecondaryButton>
      </div>
    );
  }
}

const ZoomControls = connect()(_ZoomControls);

export default ZoomControls;

