import React from 'react';
import { IndexRoute, Route } from 'react-router';
import resolvePath from 'object-resolve-path';
/* Helpers */
import { displaySubjectCreate } from 'state/selectors/subjectSearchSelectors';
import * as profileSelectors from 'state/selectors/profileSelectors';
/* Import route components for router */
import App from './App/App';
import Checkin from './Checkin/Checkin';
import Home from './Home/Home';
import NotFound from './NotFound/NotFound';
import SubjectAddCapture from './SubjectAddCapture/SubjectAddCapture';
import SubjectCaptureEdit from './SubjectCaptureEdit/SubjectCaptureEdit';
import SubjectCreate from './SubjectCreate/SubjectCreate';
import SubjectEdit from './SubjectEdit/SubjectEdit';
import SubjectProfile from './SubjectProfile/SubjectProfile';
import SubjectSearch from './SubjectSearch/SubjectSearch';


// To interact with the redux store, e.g. for authentication,
// pass `store` in as an argument below
export default (store) => {
  const requireAuth = (nextState, replace, cb) => {
    const { auth: { user } } = store.getState();

    if (!user) {
      replace('/login');
    }
    cb();
  };

  const defaultToSearchIfLoggedIn = (nextState, replace, cb) => {
    const { auth: { user } } = store.getState();

    if (user) {
      replace('/search');
    } else {
      replace('/login');
    }
    cb();
  };

  const requireSelectedUser = (nextState, replace, cb) => {
    const state = store.getState();
    const subjectId = resolvePath(state, 'views.profile.subject');

    if (!subjectId || !resolvePath(state, `subjects.data.items[${subjectId}]`)) {
      replace('/search');
    }

    cb();
  };

  const requireTodaysVisit = (nextState, replace, cb) => {
    const state = store.getState();
    const subjectId = profileSelectors.getProfileSubjectId(state);
    const todaysVisit = profileSelectors.getTodaysVisit(subjectId)(state);

    if (!todaysVisit) {
      replace('/subject');
    }
    cb();
  };

  const requireNoCheckIn = (nextState, replace, cb) => {
    const state = store.getState();
    const subjectId = profileSelectors.getProfileSubjectId(state);
    const todaysVisit = profileSelectors.getTodaysVisit(subjectId)(state);

    if (!subjectId || (subjectId && todaysVisit)) {
      replace('/subject');
    }
    cb();
  };

  const requireEditUser = (nextState, replace, cb) => {
    const state = store.getState();
    const subjectId = resolvePath(state, 'views.subjectEdit.id');

    if (!subjectId || !resolvePath(state, `subjects.data.items[${subjectId}]`)) {
      replace('/search');
    }

    cb();
  };

  const requireSubjectSearch = (nextState, replace, cb) => {
    if (!displaySubjectCreate(store.getState())) {
      replace('/search');
    }
    cb();
  };

  const requirePedaCapture = (nextState, replace, cb) => {
    if (!store.getState().views.editCapture.captureId) {
      replace('/search');
    }
    cb();
  };

  return (
    <Route path="/" component={App}>
      <IndexRoute onEnter={defaultToSearchIfLoggedIn} />
      <Route path="/login" component={Home} />
      <Route onEnter={requireAuth}>
        <Route path="/search" component={SubjectSearch} />
        <Route path="/subject" component={SubjectProfile} onEnter={requireSelectedUser} />
        <Route path="/subject/checkin" component={Checkin} onEnter={requireNoCheckIn} />
        <Route path="/subject/create" component={SubjectCreate} onEnter={requireSubjectSearch} />
        <Route path="/subject/edit" component={SubjectEdit} onEnter={requireEditUser} />
        <Route path="/subject/capture" component={SubjectAddCapture} onEnter={requireTodaysVisit} />
        <Route path="/subject/capture/edit" component={SubjectCaptureEdit} onEnter={requirePedaCapture} />
      </Route>

      { /* Catch all route */ }
      <Route path="*" component={NotFound} status={404} />
    </Route>
  );
};

