import React, { Component, PropTypes } from 'react';
import Helmet from 'react-helmet';
import {
  ThemeProvider,
  defaultTheme,
  Navbar,
  Footer
} from '@nike/ruxac';
import 'glamor/reset';
import '@nike/ruxac/styles';
import '@nike/ruxac/styles/global.style';
import '@nike/ruxac/fonts';
import '@nike/ruxac/fonts/TradeGothic/TradeGothicNikePlus';
import { browserHistory } from 'react-router';
import { connect } from 'react-redux';
import { asyncConnect } from 'redux-connect';
import { ScanPrompt } from 'components';
import * as instrumentActions from 'state/modules/instruments';
import * as alteaActions from 'state/modules/altea';
import * as appActions from 'state/modules/app';
import { isElectron } from 'helpers/electron';
import './global.style.js';
import config from '../../config';

/**
 * The top-level route component for the app
 * @param {object} children The children components definined inside the route,
 *                          i.e. <Home /> in <IndexRoute component={Home} />
 */
export const mapStateToProps = (state) => ({
  instruments: state.instruments,
  navOpen: state.views.app.navOpen,
  user: state.auth.user,
  userOrg: state.auth.userOrg
});

export const mapDispatchToProps = {
  closeNav: appActions.closeNav,
  completeScanAndLoadSubject: alteaActions.completeScanAndLoadSubject,
  loadInstruments: instrumentActions.loadInstruments,
  openNav: appActions.openNav,
};

export class _App extends Component {
  static propTypes = {
    children: PropTypes.object.isRequired,
    completeScanAndLoadSubject: PropTypes.func.isRequired,
    user: PropTypes.object,
    userOrg: PropTypes.string
  };

  componentDidMount() {
    if (isElectron()) {
      const { completeScanAndLoadSubject } = this.props;

      window.Bridge.completeScan = completeScanAndLoadSubject;
    }
  }

  goHome = () => {
    browserHistory.push('/');
  }


  render() {
    const {
      user,
      userOrg
    } = this.props;

    return (
      <ThemeProvider theme={defaultTheme}>
        <div className={isElectron() ? 'electron' : 'web'}>
          <Helmet {...config.app.head} />
          <Navbar
            logoClick={this.goHome}
            appSubtitle="BodyScan"
            appTitle="Voltron"
            user={user}
            userOrgContent={userOrg || 'BodyLab'}
          />
          <div className="container-fluid">
            <div className="row">
              <div className="col col-xs-12 col-sm-offset-1 col-sm-10">
                {this.props.children}
              </div>
            </div>
          </div>
          {isElectron() &&
            <ScanPrompt />
          }
          <Footer />
        </div>
      </ThemeProvider>
    );
  }
}

export const asyncConnectPromise = ({ store: { dispatch, getState } }) => {
  if (getState().auth.user) {
    return dispatch(instrumentActions.loadInstruments('?q=*'));
  }
};

const AsyncConnectedApp = asyncConnect([
  {
    deferred: true,
    promise: asyncConnectPromise
  }
])(_App);

const ConnectedApp = connect(mapStateToProps, mapDispatchToProps)(AsyncConnectedApp);

export default ConnectedApp;

