import React, { Component, PropTypes } from 'react';
import { connect } from 'react-redux';
import { PrimaryButton } from '@nike/ruxac';

export const mapStateToProps = (state) => ({
  user: state.auth.user
});

/**
 * The main authentication portal for the app
 * @param {object} user The user object we get back from Ping after authentication
 */

export class _Home extends Component {
  static propTypes = {
    user: PropTypes.any
  };

  render() {
    const { user } = this.props;

    return (
      <div>
        <div className="jumbotron">
          {!user &&
            <div>
              <h1>Login required.</h1>

              <p>This will authenticate you via Ping and route you back to the experience.</p>

              <PrimaryButton href="/oauth/login">LOGIN</PrimaryButton>
            </div>
          }

          {user &&
            <div>
              SITE CONTENT
            </div>
          }
        </div>
      </div>
    );
  }
}

export default connect(mapStateToProps)(_Home);

