import React, { Component, PropTypes } from 'react';
import DynamicForm, { createValidator } from '@nike/outfielder';
import { browserHistory } from 'react-router';
import { Banner } from '@nike/lipstick';
import { connect } from 'react-redux';
import { addResourceImage } from 'helpers/resourceHelper';
import { instrumentSelectors } from 'state/selectors';
import * as profileActions from 'state/modules/profile';
import * as subjectManagerActions from 'state/modules/subjectManager';
import { SubjectPhotoUploader } from 'components';

export const mapStateToProps = (state) => ({
  subjectInstrument: instrumentSelectors.getLatestInstrument('subject')(state),
  subjectCreating: state.subjectManager.creating,
  user: state.auth.user,
  userOrg: state.auth.userOrg,
});

export const mapDispatchToProps = {
  createSubject: subjectManagerActions.createSubject,
  setProfileSubject: profileActions.setProfileSubject
};

class _SubjectCreate extends Component {
  static propTypes = {
    createSubject: PropTypes.func.isRequired,
    subjectCreating: PropTypes.bool.isRequired,
    subjectInstrument: PropTypes.object,
    setProfileSubject: PropTypes.func.isRequired,
    user: PropTypes.object,
    userOrg: PropTypes.string,
  };

  constructor() {
    super();
    this.state = {
      subjectPhotoFile: null,
      subjectPhotoSrc: null
    };
  }

  addResourceFile = (files) => {
    addResourceImage(files, (result) => {
      this.setState({
        subjectPhotoSrc: result.src,
        subjectPhotoFile: result.file
      });
    });
  }

  createSubjectSelectAndRouteToSelectStudy = (values) => {
    const {
      createSubject,
      subjectInstrument,
      user,
      userOrg
    } = this.props;
    const { subjectPhotoFile } = this.state;

    const data = {
      instrument_id: subjectInstrument.id,
      instrument_version: subjectInstrument.version,
      instrument_key: subjectInstrument.instrument_key,
      capture_by_user: user.username,
      capture_country: 'USA',
      capture_by_org: userOrg,
      attributes: {
        ...values
      }
    };
    const fileData = {
      attributes: {
        resource_type: 'subject_photo',
        created_at: new Date().toISOString()
      }
    };

    return createSubject(data, subjectPhotoFile, fileData).then((createdSubject) => {
      const { setProfileSubject } = this.props;

      setProfileSubject(createdSubject.id);
      browserHistory.push('/subject');
    });
  }

  goBack = () => {
    browserHistory.goBack();
  }

  render() {
    const { subjectInstrument, subjectCreating } = this.props;
    const { subjectPhotoFile, subjectPhotoSrc } = this.state;

    return (
      <div className="col col-xs-12" data-e2e="subject-create">
        <Banner>
          <h1>Create Subject</h1>
        </Banner>
        {subjectInstrument &&
          <div data-e2e="subject-create-wrapper">
            <div>
              <SubjectPhotoUploader
                addFile={this.addResourceFile}
                resourceFileSrc={subjectPhotoSrc}
                resourceFile={subjectPhotoFile}
              />
            </div>
            <DynamicForm
              data-e2e="subject-create-create-subject-form"
              form="createSubject"
              instrument={subjectInstrument}
              displayMode="createform"
              onSubmit={this.createSubjectSelectAndRouteToSelectStudy}
              onCancel={this.goBack}
              validate={createValidator(subjectInstrument.capture_attribute_definitions)}
              loading={subjectCreating}
              submitContent="Create"
             />
          </div>
        }
      </div>
    );
  }
}

const SubjectCreate = connect(mapStateToProps, mapDispatchToProps)(_SubjectCreate);

export default SubjectCreate;

