import EXIF from 'exif-js';
require('canvas-toBlob');
require('blob.js');

const base64ToArrayBuffer = (base64) => {
  base64 = base64.replace(/^data:([^;]+);base64,/gmi, '');
  const binaryString = atob(base64);
  const len = binaryString.length;
  const bytes = new Uint8Array(len);

  for (let i = 0; i < len; i++) {
    bytes[i] = binaryString.charCodeAt(i);
  }
  return bytes.buffer;
};

export const addResourceImage = (files, addResourceCB) => {
  let src = null;

  // Don't do any of this stuff until we get a file
  if (files.length > 0) {
    const fr = new FileReader();

    fr.onloadend = function (e) { // eslint-disable-line
      // Use our little function to get an arraybuffer from the base64
      const blob = new Blob([base64ToArrayBuffer(e.target.result)], { type: files[0].type });

      function cb() {
        // we now have accesqs to the EXIF tags inside the callback
        const exif = EXIF.getAllTags(this);
        const orientation = exif.Orientation;

        // Create a dummy canvas to manipulate stuff in
        // This doesn't get injected into the dom
        const can = document.createElement('canvas');
        const ctx = can.getContext('2d');
        const thisImage = new Image();

        // Once our new image has loaded, we can start playing
        thisImage.onload = function () {  // eslint-disable-line
          can.width = thisImage.width;
          can.height = thisImage.height;
          ctx.save();

          const width = can.width;
          const styleWidth = can.style.width;
          const height = can.height;
          const styleHeight = can.style.height;

          if (orientation) {
            if (orientation > 4) {
              can.width = height;
              can.style.width = styleHeight;
              can.height = width;
              can.style.height = styleWidth;
            }
            // this checks the orientation and sets the
            // canvas image appropriately
            switch (orientation) {
              case 2:
                ctx.translate(width, 0);
                ctx.scale(-1, 1); break;
              case 3:
                ctx.translate(width, height);
                ctx.rotate(Math.PI); break;
              case 4:
                ctx.translate(0, height);
                ctx.scale(1, -1); break;
              case 5:
                ctx.rotate(0.5 * Math.PI);
                ctx.scale(1, -1); break;
              case 6:
                ctx.rotate(0.5 * Math.PI);
                ctx.translate(0, -height); break;
              case 7:
                ctx.rotate(0.5 * Math.PI);
                ctx.translate(width, -height);
                ctx.scale(-1, 1); break;
              case 8:
                ctx.rotate(-0.5 * Math.PI);
                ctx.translate(-width, 0); break;
              default:
                break;
            }
          }

          ctx.drawImage(thisImage, 0, 0);
          ctx.restore();

          // at this point you can save the image away to your back-end using 'dataURL
          src = can.toDataURL();

          can.toBlob((daBlob) => {
            const temp = new File([daBlob], files[0].name, { type: files[0].type, lastModified: Date.now() });

            // Now that we have our file, and we have base64 src
            // for our display image - send them back out
            if (typeof addResourceCB === 'function') {
              addResourceCB({
                file: temp,
                src
              });
            }

            return temp;
          }, files[0].type);
        };
        // now trigger the onload function by setting the src to your HTML5 file object (called 'file' here)
        thisImage.src = URL.createObjectURL(blob);
      }
      // Call EXIF.getData to trigger callback
      EXIF.getData(blob, cb);
    };
    // Read the file as data url to trigger the onloadend event
    fr.readAsDataURL(files[0]);
  }
};

