/**
 * Duck for dealing with capture create/update w/ file uploads
 * TODO: Add this to mothergoose?
 */
import { viewDuckFactory } from '@nike/mother-goose';
import {
  loadSubject,
  createSubject as createSubjectCapture,
  updateSubject as updateSubjectCapture
} from './subjects';
import { createResource } from './resources';
import { uploadFile } from './files';

export const CREATE_CAPTURE_FILE_REQUEST = 'subjectManager/CREATE_CAPTURE_FILE_REQUEST';
export const CREATE_CAPTURE_FILE_SUCCESS = 'subjectManager/CREATE_CAPTURE_FILE_SUCCESS';
export const CREATE_CAPTURE_FILE_ERROR = 'subjectManager/CREATE_CAPTURE_FILE_ERROR';
export const UPDATE_CAPTURE_FILE_REQUEST = 'subjectManager/UPDATE_CAPTURE_FILE_REQUEST';
export const UPDATE_CAPTURE_FILE_SUCCESS = 'subjectManager/UPDATE_CAPTURE_FILE_SUCCESS';
export const UPDATE_CAPTURE_FILE_ERROR = 'subjectManager/UPDATE_CAPTURE_FILE_ERROR';

const initialState = {
  creating: false,
  createError: false,
  updating: false,
  updateError: false,
  error: ''
};

const subjectManager = viewDuckFactory('subjectManager', initialState);

export const subjectManagerDuck = subjectManager;

export const createSubject = (data, file, fileData) => ({
  types: [CREATE_CAPTURE_FILE_REQUEST, CREATE_CAPTURE_FILE_SUCCESS, CREATE_CAPTURE_FILE_ERROR],
  promise: (client, dispatch) => dispatch(createSubjectCapture(data))
    .then((createdSubject) => {
      if (file) {
        const { id: captureId } = createdSubject;
        const { captureByOrg, captureByUser } = data;
        const resourceData = {
          ...fileData,
          capture_id: captureId,
          capture_by_user: captureByUser,
          capture_by_org: captureByOrg,
          resource_path: file.name,
          content_type: file.type
        };

        // Create Resource
        return dispatch(createResource(resourceData))
        .then((createdResource) => dispatch(uploadFile(createdResource.upload_url, file)))
        // Reload subject with added capture
        .then(() => dispatch(loadSubject(captureId)))
        // return subject refreshed with resource
        .then((refreshedSubject) => refreshedSubject);
      }

      // Return subject for access
      return createdSubject;
    })
});

export const updateSubject = (id, data, file, fileData) => ({
  types: [UPDATE_CAPTURE_FILE_REQUEST, UPDATE_CAPTURE_FILE_SUCCESS, UPDATE_CAPTURE_FILE_ERROR],
  promise: (client, dispatch) => dispatch(updateSubjectCapture(id, data))
    .then((updatedSubject) => {
      if (file) {
        const { id: captureId } = updatedSubject;
        const { captureByOrg, captureByUser } = data;
        const resourceData = {
          ...fileData,
          capture_id: captureId,
          capture_by_user: captureByUser,
          capture_by_org: captureByOrg,
          resource_path: file.name,
          content_type: file.type
        };

        // Create Resource
        return dispatch(createResource(resourceData))
          .then((createdResource) => dispatch(uploadFile(createdResource.upload_url, file)))
          // Reload subject with added capture
          .then(() => dispatch(loadSubject(id)))
          // return subject refreshed with resource
          .then((refreshedSubject) => refreshedSubject);
      }
      // Return updatedSubject
      return updatedSubject;
    })
});

const reducer = (state, action) => {
  switch (action.type) {
    case CREATE_CAPTURE_FILE_REQUEST:
      return {
        ...state,
        creating: true
      };
    case CREATE_CAPTURE_FILE_SUCCESS:
      return {
        ...state,
        creating: false,
        createError: false
      };
    case CREATE_CAPTURE_FILE_ERROR:
      return {
        ...state,
        creating: false,
        createError: true,
        error: action.error
      };
    case UPDATE_CAPTURE_FILE_REQUEST:
      return {
        ...state,
        updating: true
      };
    case UPDATE_CAPTURE_FILE_SUCCESS:
      return {
        ...state,
        updating: false,
        updateError: false
      };
    case UPDATE_CAPTURE_FILE_ERROR:
      return {
        ...state,
        updating: false,
        updateError: true,
        error: action.error
      };

    default:
      return subjectManager.reducer(state, action);
  }
};

export default reducer;

