import superagent from 'superagent';
/**
 * Duck for handling resource file uploads
 */
export const UPLOAD_REQUEST = 'file/UPLOAD_REQUEST';
export const UPLOAD_PROGRESS = 'file/UPLOAD_PROGRESS';
export const UPLOAD_SUCCESS = 'file/UPLOAD_SUCCESS';
export const UPLOAD_ERROR = 'file/UPLOAD_ERROR';

const initialState = {};

/**
 * Generate File initial state for upload
 */
export const fileInitialState = (file) => ({
  // File fields
  name: file.name,
  lastModified: file.lastModified,
  // We omit file.lastModifiedDate as it causes redux mutation errors
  size: file.size,
  type: file.type,

  // Resource status
  errorMessage: '',
  uploading: true,
  uploaded: false,
  uploadError: false,
  percent: 0
});

/**
 * Action for file upload progress
 * @param  {Object} file     The file that is being uploaded
 * @param  {Object} progress Progress response Object from XHR request
 */
export const uploadProgress = (file, progress) => ({
  type: UPLOAD_PROGRESS,
  file,
  progress
});

/**
 * Upload file async action
 * @param  {String} uploadUrl The S3 URL to PUT the file to
 * @param  {Object} file      The file input object
 */
export const uploadFile = (uploadUrl, file) => ({
  types: [UPLOAD_REQUEST, UPLOAD_SUCCESS, UPLOAD_ERROR],
  promise: (client, dispatch) => superagent.put(uploadUrl)
    // Dispatch uploadProgress with file and progress on progress response
    .on('progress', (progress) => dispatch(uploadProgress(file, progress)))
    .send(file),
  file
});

const reducer = (state = initialState, action = {}) => {
  switch (action.type) {
    case UPLOAD_REQUEST:
      // fileInitialState to files keyed by filename.lastmodified`
      return {
        ...state,
        [`${action.file.name}_${action.file.lastModified}`]: fileInitialState(action.file)
      };
    case UPLOAD_PROGRESS:
      // Update progress of keyed file
      const updatedFile = {
        ...state[`${action.file.name}_${action.file.lastModified}`],
        percent: action.progress.percent
      };

      return {
        ...state,
        [`${action.file.name}_${action.file.lastModified}`]: updatedFile
      };
    case UPLOAD_SUCCESS:
      const uploadedFile = {
        ...state[`${action.file.name}_${action.file.lastModified}`],
        percent: 100,
        uploaded: true,
        uploading: false,
        uploadError: false
      };

      return {
        ...state,
        [`${action.file.name}_${action.file.lastModified}`]: uploadedFile
      };
    case UPLOAD_ERROR:
      const fileUploadError = {
        ...state[`${action.file.name}_${action.file.lastModified}`],
        uploading: false,
        uploaded: false,
        uploadError: true,
        errorMessage: action.error
      };

      return {
        ...state,
        [`${action.file.name}_${action.file.lastModified}`]: fileUploadError
      };
    default:
      return state;
  }
};

export default reducer;

