import React, { Component, PropTypes } from 'react';
import { connect } from 'react-redux';
import { Banner } from '@nike/lipstick';
import { browserHistory } from 'react-router';
import DynamicForm, { createValidator } from '@nike/outfielder';
import { addResourceImage } from 'helpers/resourceHelper';
import { getEditSubject, getEditSubjectInstrument, subjectIsUpdating } from 'state/selectors/subjectEditSelectors';
import * as subjectEditActions from 'state/modules/subjectEdit';
import * as subjectManagerActions from 'state/modules/subjectManager';
import { SubjectPhotoUploader } from 'components';
import { getSubjectPhotoId } from 'state/selectors/subjectSelectors';
import { getLastLocation } from 'state/selectors/locationSelectors';

export const mapStateToProps = (state) => ({
  lastLocation: getLastLocation(state),
  subjectToEdit: getEditSubject(state),
  subjectInstrument: getEditSubjectInstrument(state),
  updatingSubject: subjectIsUpdating(state),
  user: state.auth.user,
  userOrg: state.auth.userOrg
});
const mapDispatchToProps = {
  setSubjectToEdit: subjectEditActions.setSubjectToEdit,
  updateSubject: subjectManagerActions.updateSubject
};

class _SubjectEdit extends Component {
  static propTypes = {
    lastLocation: PropTypes.string,
    setSubjectToEdit: PropTypes.func.isRequired,
    subjectToEdit: PropTypes.object,
    subjectInstrument: PropTypes.object,
    updateSubject: PropTypes.func.isRequired,
    updatingSubject: PropTypes.bool,
    user: PropTypes.object.isRequired,
    userOrg: PropTypes.string.isRequired,
  }

  constructor() {
    super();
    this.state = {
      subjectPhotoFile: null,
      subjectPhotoSrc: null
    };
  }

  addResourceFile = (files) => {
    addResourceImage(files, (result) => {
      this.setState({
        subjectPhotoSrc: result.src,
        subjectPhotoFile: result.file
      });
    });
  }

  updateSubject = (values) => {
    const {
      lastLocation,
      setSubjectToEdit,
      subjectToEdit,
      updateSubject,
      subjectInstrument,
      user,
      userOrg
    } = this.props;
    const { subjectPhotoFile } = this.state;

    const data = {
      instrument_id: subjectToEdit.instrument_id,
      instrument_version: subjectInstrument.version,
      instrument_key: subjectInstrument.instrument_key,
      capture_by_user: user.username,
      capture_country: 'USA',
      capture_by_org: userOrg,
      attributes: {
        ...values
      }
    };
    const fileData = {
      attributes: {
        resource_type: 'subject_photo',
        created_at: new Date().toISOString()
      }
    };

    updateSubject(subjectToEdit.id, data, subjectPhotoFile, fileData).then(() => {
      browserHistory.push(lastLocation);
      setSubjectToEdit(null);
    });
  }

  render() {
    const {
      updatingSubject,
      subjectInstrument,
      subjectToEdit
    } = this.props;
    const { subjectPhotoFile, subjectPhotoSrc } = this.state;

    return subjectToEdit ? (
      <div className="col col-xs-12" data-e2e="subject-edit">
        <Banner data-e2e="subject-edit-banner">
          <h1 data-e2e="subject-edit-banner-label">Edit Subject</h1>
        </Banner>
        <div>
          <SubjectPhotoUploader
            addFile={this.addResourceFile}
            resourceFileSrc={subjectPhotoSrc}
            resourceFile={subjectPhotoFile}
            resourceId={getSubjectPhotoId(subjectToEdit)}
          />
        </div>
        <DynamicForm
          form="editSubject"
          data-e2e="subject-edit-form"
          initialValues={subjectToEdit.attributes}
          instrument={subjectInstrument}
          displayMode="editform"
          loading={updatingSubject}
          onSubmit={this.updateSubject}
          disableSubmit={!subjectPhotoFile}
          onCancel={browserHistory.goBack}
          submitContent="Update"
          validate={createValidator(subjectInstrument.capture_attribute_definitions)}
        />
      </div>
    ) : null;
  }
}

const SubjectEdit = connect(mapStateToProps, mapDispatchToProps)(_SubjectEdit);

export default SubjectEdit;

