import resolvePath from 'object-resolve-path';
import { createSelector } from 'reselect';

export const getSubjectToEditId = (state) => resolvePath(state, 'views.subjectEdit.id');
export const getSubjects = (state) => resolvePath(state, 'subjects.data.items');
export const getInstruments = (state) => resolvePath(state, 'instruments.data.items');
export const subjectIsUpdating = (state) => resolvePath(state, 'subjectManager.updating');

export const getEditSubject = createSelector(
  getSubjectToEditId,
  getSubjects,
  (id, subjects) => subjects[id]
);

export const getEditSubjectInstrument = createSelector(
  getEditSubject,
  getInstruments,
  (subject, instruments) => {
    if (subject) {
      return instruments[subject.instrument_key][subject.instrument_version];
    }
  }
);

