import React, { Component, PropTypes } from 'react';
import { connect } from 'react-redux';
import { browserHistory } from 'react-router';
import { PrimaryButton, SecondaryButton } from '@nike/ruxac';
import { SubjectHeader, SubjectProfileList, SubjectProfileListItem } from 'components';
import { profileSelectors } from 'state/selectors';
import * as createCaptureActions from 'state/modules/createCapture';
import * as checkinActions from 'state/modules/checkin';
import * as profileActions from 'state/modules/profile';
import * as subjectEditActions from 'state/modules/subjectEdit';

export const mapStateToProps = (state) => ({
  subject: state.subjects.data.items[state.views.profile.subject],
  todaysVisit: profileSelectors.getTodaysVisitWithData(state),
  isLoading: profileSelectors.isProfileLoading(state)
});

export const mapDispatchToProps = {
  loadSubjectProfileData: profileActions.loadSubjectProfileData,
  setSubjectToEdit: subjectEditActions.setSubjectToEdit,
  setCaptureInfo: createCaptureActions.setCaptureInfo,
  setSubjectToCheckin: checkinActions.setSubjectToCheckin
};

class _SubjectProfile extends Component {
  static propTypes = {
    loadSubjectProfileData: PropTypes.func.isRequired,
    setSubjectToEdit: PropTypes.func.isRequired,
    setCaptureInfo: PropTypes.func.isRequired,
    setSubjectToCheckin: PropTypes.func.isRequired,
    subject: PropTypes.object.isRequired,
    todaysVisit: PropTypes.object,
    isLoading: PropTypes.bool
  }

  componentDidMount = () => {
    const {
      loadSubjectProfileData,
      subject
    } = this.props;

    loadSubjectProfileData(subject.id);
  }

  addCapture = () => {
    const {
      setCaptureInfo,
      subject: { id: subjectId },
      todaysVisit: { id: visitId }
    } = this.props;

    setCaptureInfo(subjectId, visitId);
    browserHistory.push('/subject/capture');
  }

  checkinSubject = () => {
    const { subject: { id: subjectId }, setSubjectToCheckin } = this.props;

    setSubjectToCheckin(subjectId);
    browserHistory.push('/subject/checkin');
  }

  editSubject = () => {
    const { subject, setSubjectToEdit } = this.props;

    setSubjectToEdit(subject.id);
    browserHistory.push('/subject/edit');
  }

  renderButton = () => {
    const { todaysVisit, isLoading } = this.props;
    const clickHandler = todaysVisit ? this.addCapture : this.checkinSubject;
    const text = todaysVisit ? 'Add Capture' : 'Check-in';
    const primaryButton = !!todaysVisit;

    if (!isLoading) {
      if (!primaryButton) {
        return (
          <SecondaryButton
            data-e2e="subject-profile-checkin-subject-button"
            onClick={clickHandler}>
            {text}
          </SecondaryButton>
        );
      }
      return (
        <PrimaryButton
          data-e2e="subject-profile-checkin-subject-button"
          onClick={clickHandler}>
          {text}
        </PrimaryButton>
      );
    }
  }

  render() {
    const {
      subject,
      todaysVisit
    } = this.props;

    return (
      <div>
        <SubjectHeader subject={subject} editSubject={this.editSubject} />
        {todaysVisit &&
          <div>
            <div className="row">
              <div className="col-xs-12">
                <h1 data-e2e="subject-profile-todays-visit-title">Today's Visit</h1>
              </div>
            </div>
            <SubjectProfileListItem visit={todaysVisit} />
          </div>
        }
        <div className="row" style={{ marginTop: '20px' }}>
          {this.renderButton()}
        </div>
        <SubjectProfileList />
      </div>
    );
  }
}

const SubjectProfile = connect(mapStateToProps, mapDispatchToProps)(_SubjectProfile);

export default SubjectProfile;

