/**
 *  API for Express server
 *  This is essentially Express middleware to
 *  proxy /api requests through the server
 *  ApiClient to get around CORS access control.
 *  All routes being used on '/api' subpath.
 */
import { Router } from 'express';
import ApiClient from 'helpers/ApiClient';
const api = Router();

// Check for expired auth cookie
api.use((req, res, next) => {
  if (req.cookies && req.cookies.exp) {
    // Convert exp to milliseconds for comparison with Date.now()
    const exp = (req.cookies.exp) * 1000;

    if (exp < Date.now()) {
      return res.status(401).send('Unauthorized Token');
    }
  }
  next();
});

api.use((req, res) => {
  const client = new ApiClient(req);

  // Use ApiClient
  client[req.method.toLowerCase()](req.url)
    .then(data => {
      res.json(data);
    }, err => {
      // Send error here
      res.status(err.status || 400).json(err);
    });
});

export default api;

