/**
 *  oAuth endpoints for Express server
 *  All routes being used on '/oauth' subpath.
 */
import { Router } from 'express';
import config from './config';

const oauth = Router();

/**
 *  Login user thru redirect to ping
 */

oauth.get('/login', (req, res) => {
  const pingOauth = {
    host: config.oauthHost,
    redirectUri: config.oauthRedirectUri,
    clientId: config.oauthClientId,
    responseType: config.oauthResponseType,
    scope: config.oauthScope,
    nonce: config.oauthNonce
  };

  return res.redirect(`${pingOauth.host}?redirect_uri=${pingOauth.redirectUri}&client_id=${pingOauth.clientId}&response_type=${pingOauth.responseType}&scope=${pingOauth.scope}&nonce=${pingOauth.nonce}&response_mode=form_post`);
});

/**
 *  Logout user
 */
oauth.get('/logout', (req, res) => {
  // Logout of Ping?
  // Destroy cookies
  res.clearCookie('user', { domain: config.host.replace(/^[^\.]+/, '') }); // eslint-disable-line
  res.clearCookie('exp', { domain: config.host.replace(/^[^\.]+/, '') }); // eslint-disable-line
  res.clearCookie('accessToken', { domain: config.host.replace(/^[^\.]+/, '') }); // eslint-disable-line
  return res.redirect('/');
});

export default oauth;

