/* eslint import/no-named-as-default:0 */
import { combineReducers } from 'redux';
import { routerReducer } from 'react-router-redux';
import { reducer as reduxAsyncConnect } from 'redux-connect';
import { reducer as form } from 'redux-form';
/**
 * Import your state reducer modules and add them to the root reducer
 */
import altea from './modules/altea';
import app from './modules/app';
import auth from './modules/auth';
import captures from './modules/captures';
import checkin from './modules/checkin';
import createCapture from './modules/createCapture';
import editCapture from './modules/editCapture';
import files from './modules/files';
import instruments from './modules/instruments';
import location from './modules/location';
import objViewer from './modules/objViewer';
import profile from './modules/profile';
import releaseAndWaiverConsent from './modules/releaseAndWaiverConsent';
import resources from './modules/resources';
import resourceLoader from './modules/resourceLoader';
import subjects from './modules/subjects';
import subjectEdit from './modules/subjectEdit';
import subjectManager from './modules/subjectManager';
import subjectSearch from './modules/subjectSearch';
import visits from './modules/visits';

export default combineReducers({
  auth,
  captures,
  files,
  form,
  instruments,
  location,
  reduxAsyncConnect,
  releaseAndWaiverConsent,
  resources,
  resourceLoader,
  routing: routerReducer,
  subjects,
  subjectManager,
  views: combineReducers({
    altea,
    app,
    createCapture,
    editCapture,
    checkin,
    objViewer,
    profile,
    subjectEdit,
    subjectSearch
  }),
  visits
});

