import { LOCATION_CHANGE } from 'react-router-redux';

const initialState = {
  current: '/',
  last: '/'
};

const reducer = (state = initialState, action = {}) => {
  switch (action.type) {
    case LOCATION_CHANGE:
      const { pathname } = action.payload;

      if (state.current !== pathname) {
        return {
          current: pathname,
          last: state.current
        };
      }
      return state;
    default:
      return state;
  }
};

export default reducer;

